ть нажать Заполнить обязательные поля. Зачем??? Это неудобно.',2,'Изменен hidden_from_responsible.'),(1695,'2014-07-23 13:48:38',1,18,'25726','Статус изменен на \"На проверку\"',2,'Изменен author.'),(1696,'2014-07-23 19:48:55',1,54,'409','Credit object',1,''),(1697,'2014-07-24 10:10:30',1,3,'109','adm@rekurs.org',1,''),(1698,'2014-07-24 10:11:46',1,20,'360','Клиент nalogovik.ru',1,''),(1699,'2014-07-24 10:12:23',1,20,'360','Клиент nalogovik.ru',2,'Изменен rate.'),(1700,'2014-07-25 05:58:56',1,18,'25903','При этапе Отправка счетов, при формировании письма (Иванова делает) должны прикрепляться счета в тело письма. ',2,'Изменен hidden_from_responsible.'),(1701,'2014-07-25 05:59:00',1,18,'25902','Ожидаемую маржинальность должна заполнять Иванова.7.	Ответственный менеджер (тут Иванова) после отправки письма должен заполнить новое поле в лиде «Ожидаемая Маржинальность». После этого лид переходит',2,'Изменен text и hidden_from_responsible.'),(1702,'2014-07-25 05:59:02',1,18,'25901','При загрузке Документов для клиента (от Ивановой) просит также загрузить платежные поручения и счета, Которые уже загружены.',2,'Изменен hidden_from_responsible.'),(1703,'2014-07-25 05:59:06',1,18,'25900','Сбоит линия статусов (не показывает нужный статус, скрин во вложении). ',2,'Изменен hidden_from_responsible.'),(1704,'2014-07-25 06:50:28',1,20,'331','Менеджер проекта Мебельный проект',3,''),(1705,'2014-07-25 06:50:28',1,20,'300','Менеджер проекта Модули - интеграция с сервисом лицензирования',3,''),(1706,'2014-07-25 06:50:28',1,20,'260','Разработчик Модуль удаленного управления окном браузера',3,''),(1707,'2014-07-25 06:50:28',1,20,'259','Разработчик Модуль KPI (триггеры)',3,''),(1708,'2014-07-25 06:50:28',1,20,'249','Менеджер проекта SEO стажеры',3,''),(1709,'2014-07-25 06:50:28',1,20,'248','Разработчик ОКНО-ТВ',3,''),(1710,'2014-07-25 06:50:28',1,20,'223','Менеджер проекта ОКНО-ТВ',3,''),(1711,'2014-07-25 06:50:28',1,20,'214','Менеджер проекта VOX',3,''),(1712,'2014-07-25 06:50:28',1,20,'