INSERT INTO `pmanager_pm_notice` VALUES (1,'Задачу на проверку!','Теперь вы можете удобно отправлять задачи на проверку в один клик без необходимости комментировать её.','PManager/static/upload/notices/setready_1.png','/','.plus'),(2,'Пользуйтесь поиском','Воспользуйтесь динамическим поиском для того, чтобы быстро найти нужную вам задачу','PManager/static/upload/notices/search.png','/','.search-input'),(3,'Готовые задачи','Задачи, готовые к проверке, помечаются галочкой.','PManager/static/upload/notices/crit.png','/','.task-icon.ready'),(4,'Закрытие задачи','Если задача готова и вы её ставили, закройте её, чтобы видеть больше актуальных задач.','','/','.ready'),(5,'Загрузите аватарку','Вы можете украсить жизнь нашего трекера, добавив себе аватар!','PManager/static/upload/notices/Avatar477.jpg','/','li.profile'),(6,'Вставка изображений','Вы можете вставлять изображения из буфера, используя <b>ctrl+V</b>.','PManager/static/upload/notices/test_4.png','/','.task-create-wrapper'),(7,'Непрочитанные сообщения','У вас есть непрочитанные личные сообщения.','','/','.js-notificator.fa-spin'),(8,'Диаграмма Ганта','Планируйте даты проекта на календарной диаграмме','PManager/static/upload/notices/gantt.png','/','.fa-tasks'),(9,'Подтвердить задачу','После оценки задачи необходимо подтвердить её выполнение.','PManager/static/upload/notices/accept.png','/','.task-name_status .fa-comments');
