INSERT INTO `wiki_articlerevision` VALUES (1,1,'','',NULL,1,'2013-09-25 14:06:52','2013-09-25 14:06:52',NULL,0,0,1,'Мировое господство!','Наша цель'),(4,2,'','',NULL,1,'2013-10-08 14:31:19','2013-10-08 14:31:19',1,0,0,1,'Здесь совместно пишется база знаний ваших проектов, которая помогает использовать весь накопленный опыт работы сейчас и в будущем. Доступ к знаниям ограничен на уровне групп пользоваталей.','Добро пожаловать в Wiki'),(5,1,'','',NULL,1,'2013-10-08 16:17:59','2013-10-08 16:17:59',NULL,0,0,4,'HTML/CSS\r\n\r\n1.	Нет селектора кроме класса (исключение составляют семантически обязательные наследники: table.class1 td, ul.class2 li, select.class3 option)\r\n2.	Если необходимо в рамках существующей верстки добавить класс для взаимодействия с JavaScript, его наименование должно быть согласно шаблону js-объектДействие\r\n3.	По возможности, не использовать !important\r\n4.	Отделение логических блоков производится по типу наследования в названии класса. Пример: \r\ndiv.userInfo\r\n	span.userInfo-name\r\n	div.userInfo-rating\r\n		a.userInfo-rating-vote\r\n5.	Если в новый логический блок вставляется уже существующий, он описывается дополнительным классом наследования. \r\nПример:\r\n	div.userPage\r\n		div.userPage-title\r\n		div.userPage-info.userInfo\r\n			span.userInfo-name\r\n			…\r\n	\r\nJavaScript\r\n1.	Наименования переменных назначаются по шаблону типОбъект(Действие/Свойство)\r\nПримеры:\r\nBoolean	bLogoutFlag\r\nInteger	iStepCounter\r\nString	sUserName\r\nFunction	buttonClick\r\njQueryObject	$buttonLogout\r\nObject	oQueryData\r\nArray(List)	aUsers\r\n\r\n2.	Шаблоны и селекторы – только в конфигурационных переменных\r\nПримеры:\r\nvar sUserInfoTpl = ‘<div class=”userInfo”>#NAME# #LAST_NAME#</div>’,\r\nsUserPageSelector = ‘div.userPage’;\r\n\r\nsUserInfoTpl.replace(‘#NAME#’,oUser[‘NAME’]);\r\nsUserInfoTpl.replace(‘#LAST_NAME#’,sUser[‘LAST_NAME’]);\r\n\r\n$( sUserPageSelector).html(sUserInfoTpl);\r\n\r\n3.	Все ключи конфигурационных объектов пишутся заглавными буквами:\r\noUserQueryConfig = {\r\n	‘NAME_TPL’: ’<div class=”userInfo-name”></div>’,\r\n	‘SESSION_ID’: sessid,\r\n	‘QUERY_URL’: ’/get_user_info’\r\n}\r\n','Регламент фронт-енд разработки'),(6,2,'html','',NULL,1,'2013-10-08 16:20:08','2013-10-08 16:20:08',5,0,0,4,'<h2>HTML/CSS</h2>\r\n<ol>\r\n<li>Нет селектора кроме класса (исключение составляют семантически обязательные наследники: table.class1 td, ul.class2 li, select.class3 option)</li>\r\n<li>Если необходимо в рамках существующей верстки добавить класс для взаимодействия с JavaScript, его наименование должно быть согласно шаблону js-объектДействие</li>\r\n<li>По возможности, не использовать !important\r\n4. Отделение логических блоков производится по типу наследования в названии класса. Пример: \r\ndiv.userInfo\r\n	span.userInfo-name\r\n	div.userInfo-rating\r\n		a.userInfo-rating-vote</li>\r\n<li>Если в новый логический блок вставляется уже существующий, он описывается дополнительным классом наследования. \r\nПример:\r\n	div.userPage\r\n		div.userPage-title\r\n		div.userPage-info.userInfo\r\n			span.userInfo-name\r\n			…\r\n	</li>\r\n</ol>\r\n<h2>JavaScript</h2>\r\n1. Наименования переменных назначаются по шаблону типОбъект(Действие/Свойство)\r\nПримеры:\r\nBoolean	bLogoutFlag\r\nInteger	iStepCounter\r\nString	sUserName\r\nFunction	buttonClick\r\njQueryObject	$buttonLogout\r\nObject	oQueryData\r\nArray(List)	aUsers\r\n\r\n2. Шаблоны и селекторы – только в конфигурационных переменных\r\nПримеры:\r\nvar sUserInfoTpl = ‘<div class=”userInfo”>#NAME# #LAST_NAME#</div>’,\r\nsUserPageSelector = ‘div.userPage’;\r\n\r\nsUserInfoTpl.replace(‘#NAME#’,oUser[‘NAME’]);\r\nsUserInfoTpl.replace(‘#LAST_NAME#’,sUser[‘LAST_NAME’]);\r\n\r\n$( sUserPageSelector).html(sUserInfoTpl);\r\n\r\n3. Все ключи конфигурационных объектов пишутся заглавными буквами:\r\noUserQueryConfig = {\r\n	‘NAME_TPL’: ’<div class=”userInfo-name”></div>’,\r\n	‘SESSION_ID’: sessid,\r\n	‘QUERY_URL’: ’/get_user_info’\r\n}\r\n','Регламент фронт-енд разработки'