я относительного растягивания контролов (например ширина одного контрола в строке относительно ширины другого должна быть 1 к 3) использовать свойства SizePolicy: HorizontalStretch и VerticalStretch\r\n5. Сделать табуляцию на всех форма слева направо, сверху вниз.\r\n6. На всех формах располагать пейджер снизу по центру\r\n7. Сделать, чтобы лейбл слева от поля для ввода ссылки являлся ссылкой на сайт производителя (Форма список производителей)\r\n8. Сделать, чтобы лейбл слева от поля для ввода емейла являлся ссылкой на mail to (Форма список производителей) \r\n9. Заголовок у формы список вендоров должен быть просто Vendors (у остальных форм заголовок делать по аналогии)\r\n10. Помещать грид в рамку (GroupBox без текста) вместе с пейджером. Отступ от рамки до полей со всех сторон - 15. \r\n11. Если над гридом есть поля для просмотра/редактирования значений, то помещать их в рамку к гриду.\r\n12. Расстояние между полями должно быть 14\r\n13. Сверху на форме отступ 22\r\n14. Если поля на форме относятся к тем же объектам, что и грид, то помещать их в одну рамку (например форма списка вендоров), иначе если поля и грид относятся к разным объектам, то помещать их в разные рамки (например форма new order)\r\n15. Если у рамки есть текст то до него и после него ставить по одному пробелу\r\n16. Если поля ввода располагаются в несколько колонок, то между ними нужно ставить пружинку шириной 10 фиксированного типа (Fixed)\r\n17. Если на форме есть фильта, то помещать их в отдельную от грида рамку\r\n18. Правила расположения кнопок Add/Edit/Delete/Submit:\r\nКнопки должны быть выравнены по левому краю полей для ввода находящихся выше\r\nРасстояние между кнопками должно быть 9 пикселей\r\nКнопки должны содержать только текст\r\nКнопки должны находится в отдельном лейауте, который должен находится внутри лейаута с полями для ввода\r\nРасширение поля для ввода находящегося выше не должно расширять лейаут с кнопками или сами кнопки, тоесть они должны быть независимы от этого поля для ввода\r\nДля примера описанного алгоритма смотреть форму списка вендоров\r\n\r\nФорма деталей:\r\n1. Размещать невидимые контролы всегда сверху формы в горизонтальном лейауте (пока не найдено решение размещать их как то вне формы или независимо от расположения других контролов)\r\n2. Выравнивание лейбла перед полем всегда по правому краю\r\n3. После лейбла всегда должно быть двоеточие через пробел\r\n4. Сделать табуляцию на всех форма слева направо, сверху вниз.\r\n5. Заголовок формы создания нового продукта должен быть \"New Product\", а не \"New element form\", а у существующего - название продукта (Для всех форм по аналогии)\r\n6. Помещать поля в рамку (GroupBox без текста). Отступ от рамки до полей со всех сторон - 15.\r\n7. Кнопка Reset на форме деталей не нужна\r\n8. Кнопки Save/Cancel должны тоже находится в рамке под всеми полями и прижаты к последнему полю, а не к нижнему краю рамки\r\n9. Расстояние между полями должно быть 14\r\n10. Сверху на форме отступ 22\r\n11. Между кнопками и рамкой отступ 14\r\n12. Если у рамки есть текст то до него и после него ставить по одному пробелу\r\n13. Если поля ввода располагаются в несколько колонок, то между ними нужно ставить пружинку шириной 10 фиксированного типа (Fixed) ','Руководство к созданию GUI конфигураций для Omega'),(34,2,'','',NULL,NULL,'2013-10-31 02:49:03','2013-10-31 02:49:03',33,0,0,6,'Форма списка:\r\n1. Размещать невидимые контролы всегда сверху формы в горизонтальном лейауте (пока не найдено решение размещать их как то вне формы или независимо от расположения других контролов)\r\n\r\n2. Выравнивание лейбла перед полем всегда по правому краю\r\n3. После лейбла всегда должно быть двоеточие через пробел\r\n4. Для относительного растягивания контролов (например ширина одного контрола в строке относительно ширины другого должна быть 1 к 3) использовать свойства SizePolicy: HorizontalStretch и VerticalStretch\r\n5. Сделать табуляцию на всех форма слева направо, сверху вниз.\r\n6. На всех формах располагать