льта, то помещать их в отдельную от грида рамку\r\n18. Правила расположения кнопок Add/Edit/Delete/Submit:\r\nКнопки должны быть выравнены по левому краю полей для ввода находящихся выше\r\nРасстояние между кнопками должно быть 9 пикселей\r\nКнопки должны содержать только текст\r\nКнопки должны находится в отдельном лейауте, который должен находится внутри лейаута с полями для ввода\r\nРасширение поля для ввода находящегося выше не должно расширять лейаут с кнопками или сами кнопки, тоесть они должны быть независимы от этого поля для ввода\r\nДля примера описанного алгоритма смотреть форму списка вендоров\r\n\r\n\r\n\r\nФорма деталей:\r\n\r\n1. Размещать невидимые контролы всегда сверху формы в горизонтальном лейауте (пока не найдено решение размещать их как то вне формы или независимо от расположения других контролов)\r\n2. Выравнивание лейбла перед полем всегда по правому краю\r\n3. После лейбла всегда должно быть двоеточие через пробел\r\n4. Сделать табуляцию на всех форма слева направо, сверху вниз.\r\n5. Заголовок формы создания нового продукта должен быть \"New Product\", а не \"New element form\", а у существующего - название продукта (Для всех форм по аналогии)\r\n6. Помещать поля в рамку (GroupBox без текста). Отступ от рамки до полей со всех сторон - 15.\r\n7. Кнопка Reset на форме деталей не нужна\r\n8. Кнопки Save/Cancel должны тоже находится в рамке под всеми полями и прижаты к последнему полю, а не к нижнему краю рамки\r\n9. Расстояние между полями должно быть 14\r\n10. Сверху на форме отступ 22\r\n11. Между кнопками и рамкой отступ 14\r\n12. Если у рамки есть текст то до него и после него ставить по одному пробелу\r\n13. Если поля ввода располагаются в несколько колонок, то между ними нужно ставить пружинку шириной 10 фиксированного типа (Fixed) ','Руководство к созданию GUI конфигураций для Omega'),(53,8,'','',NULL,NULL,'2013-10-31 05:15:16','2013-10-31 05:15:16',22,0,0,1,'Здесь совместно пишется база знаний ваших проектов, которая помогает использовать весь накопленный опыт работы сейчас и в будущем. Доступ к знаниям ограничен на уровне групп пользоваталей.\r\n\r\nВы уже можете ознакомиться с нашим [регламентом фронт-енд разработки](front-end) . \r\n\r\n[Руководство к созданию любых конфигураций от Аккорсиса](guidelinecfg)','Добро пожаловать в Wiki'),(55,9,'','',NULL,1,'2013-11-01 14:03:44','2013-11-01 14:03:44',53,0,0,1,'Здесь совместно пишется база знаний ваших проектов, которая помогает использовать весь накопленный опыт работы сейчас и в будущем. Доступ к знаниям ограничен на уровне групп пользоваталей.\r\n\r\nВы уже можете ознакомиться с нашим [регламентом фронт-енд разработки](front-end) . \r\n\r\n[Руководство к созданию любых конфигураций от Аккорсиса](guidelinecfg)\r\n[article_list depth:2]','Добро пожаловать в Wiki'),(56,10,'','',NULL,1,'2013-11-01 14:04:14','2013-11-01 14:04:14',55,0,0,1,'Здесь совместно пишется база знаний ваших проектов, которая помогает использовать весь накопленный опыт работы сейчас и в будущем. Доступ к знаниям ограничен на уровне групп пользоваталей.\r\n\r\n[article_list depth:2]','Добро пожаловать в Wiki'),(57,1,'','',NULL,NULL,'2013-11-07 09:13:20','2013-11-07 09:13:20',NULL,0,0,8,'- Изменения, обновления и версионность КФГ\r\n1. Номер версии состоит из 4 цифр - “A.B.C.D”\r\n2. При создании кфг ей назначается текущая версия “0.1.0.0” (по умолчанию, в момент создания можно переопределить). Того, кто ее создал (автор), назовем Поставщик.\r\n3. При создании кфг на сервере (предположительно, в БД) создается журнал изменений кфг \r\n4. Каждое изменение кфг через дизайнер (любым пользователем) записывается в журнал изменений. Туда заносится дата/время изменения, тип изменения (add/edit/delete), измененный мета-объект и юзер, выполнивший изменение.\r\n5. После внесения всех запланированных изменений в кфг, текущая версия “релизится”\r\n6. Процесс “релиза” заключается в следующем:\r\n- Формирование и выгрузка инкрементального обновления кфг\r\n  - Весь журнал изменений, начиная либо с начала (если не было ни одного “релиза”), либо с последнего релиза, объединяется, группируется по определенному алгоритму и в результате получается так называемый diff - дельта изменений, между датой предыдущего “релиза” и текущим моментом.\r\n  - Diff является файлом с определенной структурой, содержащий инструкции по добавлению/изменению/удалению мета-объектов кфг вместе с самими мета-объектами.\r\n  - В журнале момент “релиза” отмечается особым образом для того, чтоб следующий diff собрать начиная с этого момента.\r\n  - Из diff-а формируется пакет обновления, которому автоматически назначается текущая версия (при этом релизер может ее  переопределить) и предыдущая, на которую и только на которую может встать данное обновление (это делается в целях обеспечения применения инкрементальных обновлений по цепочке - одно за другим). \r\n  - Пакет инкрементального обновления выгружается в файл\r\n- Формирование и выгрузка полного обновления\r\n  - Выгружаемой кфг-ии назначается текущая версия, при этом релизер может ее переопределить.\r\n  - Кфг выгружается в файл\r\n7. Кфг имеет два режима - “Просмотр” и “Редактирование”. После создания кфг имеет режим по умолчанию “Редактирование”. После импорта (установки) кфг имеет режим по умолчанию “Просмотр”. Переход из режима “Просмотр” в режим “Редактирование” определяется системой защиты кфг и примененной политикой доступа к кфг. О системе защиты см. раздел “Защита кфг”. В режиме “Просмотр” в дизайнере не доступны никакие объекты кфг, имеется возможность только редактировать настройки сервера, пользователей, лицензии. В режиме “Редактирование” кфг доступна для изменения.\r\n8. Изменение кфг и выпуск обновлений доступны только в режиме “Редактирование”\r\n9. Кфг имеет признак “На поддержке”. После импорта (установки) кфг признак выставляется в true. До тех пор, пока кфг на поддержке (признак = true) - к кфг можно применять инкрементальные обновления. Кфг снимается с поддержки при внесении в нее любых изменений (в случае, если политика доступа к кфг это позволяет). В этом случае, при переходе в режим “Редактирование” признак будет сброшен в false, в результате чего инкрементальные обновления применять больше будет нельзя. После создания кфг признак выставляется в false, таким образом, у разработчика кфг (у того, кто ее создал) не будет возможности применять инкрементальные обновления, но это ему не нужно по определению, т.к. он сам выпускает эти обновления.\r\n10. В механизм применения обновлений нужно встроить возможность переноса данных между каталогами/полями. Инкрементальные обновления при этом должны содержать соответствующие инструкции по переносу данных.\r\n11. Необходимо установление соответствия между мета-объектами старой и новой кфг - как вариант, введение GUID для ключевых (или для всех) узлов кфг (мета-объектов системы)\r\n\r\n**Защита кфг**\r\nЦели и задачи, преследуемые системой по защите кфг:\r\n- Система должна контролировать подлинность кфг, то есть быть уверенной в том, что кфг поставляется от того, от кого ожидается\r\n- Система должна обеспечивать целостность кфг, то есть исключить в ней  несанкционированные изменения\r\n- Реализовать политику доступа к кфг, определяющую возможность просмотра/редактирования мета-объектов, скриптов\r\n  - Просмотр - модификаторы доступа к мета-объектов (public/private). Public объекты можно просматривать, private - скрыты.\r\n  - Редактирование - разрешить изменять кфг только Поставщику (по умолчанию) и тем, кому автор даст явное разрешение.\r\n\r\nеще?...\r\n\r\nМероприятия по достижению поставленных целей и задач:\r\n- Необходимо создать web-сервис, содержащий реестр соответствий зарегистрированных кфг и выданных им сертификатов. Должен иметь возможность выдавать публичный сертификат для запрошенной конфигурации (по SSL).\r\n- При создании кфг генерируется пара публичный-приватный ключ с сертификатом публичного ключа. Сертификат должен быть заверен корневым CA. Публичный ключ регистрируется на web-сервисе.\r\n- При каждом “релизе” инкрементальное и полное обновление подписываются приватным ключом, подпись сохраняется в обновлении\r\n- При установке обновления (инкр. или полного) Omega-сервер делает запрос к web-сервису для получения сертификата публичного ключа, соответствующего обновляемой кфг. Из сертификата извлекается публичный ключ, с помощью которого выполняется проверка подписи обновления. Таким образом обеспечивается контроль подлинности обновлений.\r\n\r\n**Работа с данными (массовая выгрузка/загрузка)**\r\nРабота с данными в контексте выгрузки/загрузки подразумевает два сценария:\r\n- Работа с пользовательскими данными\r\nПользовательские данные - это данные предметной области, реализованной в кфг. Это данные, необходимые пользователям кфг (пример: Заказы, Клиенты, Лицензии и т.д.)\r\n- Работа с системными данными\r\nСистемные данные - это данные, необходимые для корректной работы кфг. Это могут быть перечисления (пример: Страны, Языки), классификаторы (пример: КЛАДР, МКБ).\r\n\r\nДля реализации массовой выгрузки/загрузки по 1 сценарию нужны фильтры, нужны галочки: какие каталоги выгружать, какие не надо, и это должно выгружаться из клиента - этим нужно пользователям (например, бухгалтера - для обмена данными). Ну и для бекапа, в частности. При выгрузке кфг такие данные выгружать в общем случае, не нужно. Даже если, например, и нужно перенести пользовательские данные вместе с кфг на другой сервер, то можно выгрузить кфг и данные отдельно друг от друга - это уже частный случай.\r\n\r\nДля реализации массовой выгрузки/загрузки по 2 сценарию фильтры, галочки и прочее не нужны, т.к. это системные данные, и они нужны ВСЕ по определению (иначе система будет работать неправильно). Перечисления, как вариант, должны быть встроены в кфг (или хранящиеся в БД/файле рядом с кфг) - пары ключ-значение (может с доп.атрибутами). Их уже нужно выгружать/загружать вместе с кфг. Если Перечисления хранить в каталогах, то нужно помечать такие каталоги, как системные, и тоже выгружать/загружать их вместе с кфг.','Механизм обновления и защиты конфигураций Omega'),(58,2,'','',NULL,NULL,'2013-11-07 09:14:02','2013-11-07 09:14:02',57,0,0,8,'**Изменения, обновления и версионность КФГ**\r\n\r\n1. Номер версии состоит из 4 цифр - “A.B.C.D”\r\n2. При создании кфг ей назначается текущая версия “0.1.0.0” (по умолчанию, в момент создания можно переопределить). Того, кто ее создал (автор), назовем Поставщик.\r\n3. При создании кфг на сервере (предположительно, в БД) создается журнал изменений кфг \r\n4. Каждое изменение кфг через дизайнер (любым пользователем) записывается в журнал изменений. Туда заносится дата/время изменения, тип изменения (add/edit/delete), измененный мета-объект и юзер, выполнивший изменение.\r\n5. После внесения всех запланированных изменений в кфг, текущая версия “релизится”\r\n6. Процесс “релиза” заключается в следующем:\r\n- Формирование и выгрузка инкрементального обновления кфг\r\n  - Весь журнал изменений, начиная либо с начала (если не было ни одного “релиза”), либо с последнего релиза, объединяется, группируется по определенному алгоритму и в результате получается так называемый diff - дельта изменений, между датой предыдущего “релиза” и текущим моментом.\r\n  - Diff является файлом с определенной структурой, содержащий инструкции по добавлению/изменению/удалению мета-объектов кфг вместе с самими мета-объектами.\r\n  - В журнале момент “релиза” отмечается особым образом для того, чтоб следующий diff собрать начиная с этого момента.\r\n  - Из diff-а формируется пакет обновления, которому автоматически назначается текущая версия (при этом релизер может ее  переопределить) и предыдущая, на которую и только на которую может встать данное обновление (это делается в целях обеспечения применения инкрементальных обновлений по цепочке - одно за другим). \r\n  - Пакет инкрементального обновления выгружается в файл\r\n- Формирование и выгрузка полного обновления\r\n  - Выгружаемой кфг-ии назначается текущая версия, при этом релизер может ее переопределить.\r\n  - Кфг выгружается в файл\r\n7. Кфг имеет два режима - “Просмотр” и “Редактирование”. После создания кфг имеет режим по умолчанию “Редактирование”. После импорта (установки) кфг имеет режим по умолчанию “Просмотр”. Переход из режима “Просмотр” в режим “Редактирование” определяется системой защиты кфг и примененной политикой доступа к кфг. О системе защиты см. раздел “Защита кфг”. В режиме “Просмотр” в дизайнере не доступны никакие объекты кфг, имеется возможность только редактировать настройки сервера, пользователей, лицензии. В режиме “Редактирование” кфг доступна для изменения.\r\n8. Изменение кфг и выпуск обновлений доступны только в режиме “Редактирование”\r\n9. Кфг имеет признак “На поддержке”. После импорта (установки) кфг признак выставляется в true. До тех пор, пока кфг на поддержке (признак = true) - к кфг можно применять инкрементальные обновления. Кфг снимается с поддержки при внесении в нее любых изменений (в случае, если политика доступа к кфг это позволяет). В этом случае, при переходе в режим “Редактирование” признак будет сброшен в false, в результате чего инкрементальные обновления применять больше будет нельзя. После создания кфг признак выставляется в false, таким образом, у разработчика кфг (у того, кто ее создал) не будет возможности применять инкрементальные обновления, но это ему не нужно по определению, т.к. он сам выпускает эти обновления.\r\n10. В механизм применения обновлений нужно встроить возможность переноса данных между каталогами/полями. Инкрементальные обновления при этом должны содержать соответствующие инструкции по переносу данных.\r\n11. Необходимо установление соответствия между мета-объектами старой и новой кфг - как вариант, введение GUID для ключевых (или для всех) узлов кфг (мета-объектов системы)\r\n\r\n**Защита кфг**\r\nЦели и задачи, преследуемые системой по защите кфг:\r\n- Система должна контролировать подлинность кфг, то есть быть уверенной в том, что кфг поставляется от того, от кого ожидается\r\n- Система должна обеспечивать целостность кфг, то есть исключить в ней  несанкционированные изменения\r\n- Реализовать политику доступа к кфг, определяющую возможность просмотра/редактирования мета-объектов, скриптов\r\n  - Просмотр - модификаторы доступа к мета-объектов (public/private). Public объекты можно просматривать, private - скрыты.\r\n  - Редактирование - разрешить изменять кфг только Поставщику (по умолчанию) и тем, кому автор даст явное разрешение.\r\n\r\nеще?...\r\n\r\nМероприятия по достижению поставленных целей и задач:\r\n- Необходимо создать web-сервис, содержащий реестр соответствий зарегистрированных кфг и выданных им сертификатов. Должен иметь возможность выдавать публичный сертификат для запрошенной конфигурации (по SSL).\r\n- При создании кфг генерируется пара публичный-приватный ключ с сертификатом публичного ключа. Сертификат должен быть заверен корневым CA. Публичный ключ регистрируется на web-сервисе.\r\n- При каждом “релизе” инкрементальное и полное обновление подписываются приватным ключом, подпись сохраняется в обновлении\r\n- При установке обновления (инкр. или полного) Omega-сервер делает запрос к web-сервису для получения сертификата публичного ключа, соответствующего обновляемой кфг. Из сертификата извлекается публичный ключ, с помощью которого выполняется проверка подписи обновления. Таким образом обеспечивается контроль подлинности обновлений.\r\n\r\n**Работа с данными (массовая выгрузка/загрузка)**\r\nРабота с данными в контексте выгрузки/загрузки подразумевает два сценария:\r\n- Работа с пользовательскими данными\r\nПользовательские данные - это данные предметной области, реализованной в кфг. Это данные, необходимые пользователям кфг (пример: Заказы, Клиенты, Лицензии и т.д.)\r\n- Работа с системными данными\r\nСистемные данные - это данные, необходимые для корректной работы кфг. Это могут быть перечисления (пример: Страны, Языки), классификаторы (пример: КЛАДР, МКБ).\r\n\r\nДля реализации массовой выгрузки/загрузки по 1 сценарию нужны фильтры, нужны галочки: какие каталоги выгружать, какие не надо, и это должно выгружаться из клиента - этим нужно пользователям (например, бухгалтера - для обмена данными). Ну и для бекапа, в частности. При выгрузке кфг такие данные выгружать в общем случае, не нужно. Даже если, например, и нужно перенести пользовательские данные вместе с кфг на другой сервер, то можно выгрузить кфг и данные отдельно друг от друга - это уже частный случай.\r\n\r\nДля реализации массовой выгрузки/загрузки по 2 сценарию фильтры, галочки и прочее не нужны, т.к. это системные данные, и они нужны ВСЕ по определению (иначе система будет работать неправильно). Перечисления, как вариант, должны быть встроены в кфг (или хранящиеся в БД/файле рядом с кфг) - пары ключ-значение (может с доп.атрибутами). Их уже нужно выгружать/загружать вместе с кфг. Если Перечисления хранить в каталогах, то нужно помечать такие каталоги, как системные, и тоже выгружать/загружать их вместе с кфг.','Механизм обновления и защиты конфигураций Omega'),(59,3,'','',NULL,NULL,'2013-11-07 09:15:04','2013-11-07 09:15:04',58,0,0,8,'**Изменения, обновления и версионность КФГ**\r\n\r\n1. Номер версии состоит из 4 цифр - “A.B.C.D”\r\n2. При создании кфг ей назначается текущая версия “0.1.0.0” (по умолчанию, в момент создания можно переопределить). Того, кто ее создал (автор), назовем Поставщик.\r\n3. При создании кфг на сервере (предположительно, в БД) создается журнал изменений кфг \r\n4. Каждое изменение кфг через дизайнер (любым пользователем) записывается в журнал изменений. Туда заносится дата/время изменения, тип изменения (add/edit/delete), измененный мета-объект и юзер, выполнивший изменение.\r\n5. После внесения всех запланированных изменений в кфг, текущая версия “релизится”\r\n6. Процесс “релиза” заключается в следующем:\r\n- Формирование и выгрузка инкрементального обновления кфг\r\n  - Весь журнал изменений, начиная либо с начала (если не было ни одного “релиза”), либо с последнего релиза, объединяется, группируется по опр