шен в false, в результате чего инкрементальные обновления применять больше будет нельзя. После создания кфг признак выставляется в false, таким образом, у разработчика кфг (у того, кто ее создал) не будет возможности применять инкрементальные обновления, но это ему не нужно по определению, т.к. он сам выпускает эти обновления.\r\n10. В механизм применения обновлений нужно встроить возможность переноса данных между каталогами/полями. Инкрементальные обновления при этом должны содержать соответствующие инструкции по переносу данных.\r\n11. Необходимо установление соответствия между мета-объектами старой и новой кфг - как вариант, введение GUID для ключевых (или для всех) узлов кфг (мета-объектов системы)\r\n\r\n**Защита кфг**\r\n\r\nЦели и задачи, преследуемые системой по защите кфг:\r\n\r\n1. Система должна контролировать подлинность кфг, то есть быть уверенной в том, что кфг поставляется от того, от кого ожидается\r\n\r\n2. Система должна обеспечивать целостность кфг, то есть исключить в ней  несанкционированные изменения\r\n\r\n3. Реализовать политику доступа к кфг, определяющую возможность просмотра/редактирования мета-объектов, скриптов\r\n\r\n3.1. Просмотр - модификаторы доступа к мета-объектов (public/private). Public объекты можно просматривать, private - скрыты.\r\n\r\n3.2. Редактирование - разрешить изменять кфг только Поставщику (по умолчанию) и тем, кому автор даст явное разрешение.\r\n\r\n\r\nеще?...\r\n\r\nМероприятия по достижению поставленных целей и задач:\r\n\r\n1. Необходимо создать web-сервис, содержащий реестр соответствий зарегистрированных кфг и выданных им сертификатов. Должен иметь возможность выдавать публичный сертификат для запрошенной конфигурации (по SSL).\r\n\r\n2. При создании кфг генерируется пара публичный-приватный ключ с сертификатом публичного ключа. Сертификат должен быть заверен корневым CA. Публичный ключ регистрируется на web-сервисе.\r\n\r\n3. При каждом “релизе” инкрементальное и полное обновление подписываются приватным ключом, подпись сохраняется в обновлении\r\n\r\n4.  При установке обновления (инкр. или полного) Omega-сервер делает запрос к web-сервису для получения сертификата публичного ключа, соответствующего обновляемой кфг. Из сертификата извлекается публичный ключ, с помощью которого выполняется проверка подписи обновления. Таким образом обеспечивается контроль подлинности обновлений.\r\n\r\n\r\n**Работа с данными (массовая выгрузка/загрузка)**\r\n\r\nРабота с данными в контексте выгрузки/загрузки подразумевает два сценария:\r\n\r\n1. Работа с пользовательскими данными\r\nПользовательские данные - это данные предметной области, реализованной в кфг. Это данные, необходимые пользователям кфг (пример: Заказы, Клиенты, Лицензии и т.д.)\r\n\r\n1. Работа с системными данными\r\nСистемные данные - это данные, необходимые для корректной работы кфг. Это могут быть перечисления (пример: Страны, Языки), классификаторы (пример: КЛАДР, МКБ).\r\n\r\n\r\nДля реализации массовой выгрузки/загрузки по 1 сценарию нужны фильтры, нужны галочки: какие каталоги выгружать, какие не надо, и это должно выгружаться из клиента - этим нужно пользователям (например, бухгалтера - для обмена данными). Ну и для бекапа, в частности. При выгрузке кфг такие данные выгружать в общем случае, не нужно. Даже если, например, и нужно перенести пользовательские данные вместе с кфг на другой сервер, то можно выгрузить кфг и данные отдельно друг от друга - это уже частный случай.\r\n\r\nДля реализации массовой выгрузки/загрузки по 2 сценарию фильтры, галочки и прочее не нужны, т.к. это системные данные, и они нужны ВСЕ по определению (иначе система будет работать неправильно). Перечисления, как вариант, должны быть встроены в кфг (или хранящиеся в БД/файле рядом с кфг) - пары ключ-значение (может с доп.атрибутами). Их уже нужно выгружать/загружать вместе с кфг. Если Перечисления хранить в каталогах, то нужно помечать такие каталоги, как системные, и тоже выгружать/загружать их вместе с кфг.','Механизм обновления и защиты конфигураций Omega'),(84,28,'','',NULL,NULL,'2013-11-07 10:12:25','2013-11-07 10:12:25',83,0,0,8,'**Изменения, обновления и версионность КФГ**\r\n\r\n1.   Номер версии состоит из 4 цифр - “A.B.C.D”\r\n2.   При создании кфг ей назначается текущая версия “0.1.0.0” (по умолчанию, в момент создания можно переопределить). Того, кто ее создал (автор), назовем Поставщик.\r\n3.   При создании кфг на сервере (предположительно, в БД) создается журнал изменений кфг \r\n4.   Каждое изменение кфг через дизайнер (любым пользователем) записывается в журнал изменений. Туда заносится дата/время изменения, тип изменения (add/edit/delete), измененный мета-объект и юзер, выполнивший изменение.\r\n5.   После внесения всех запланированных изменений в кфг, текущая версия “релизится”\r\n6.   Процесс “релиза” заключается в следующем:\r\n\r\n6.1. Формирование и выгрузка инкрементального обновления кфг\r\n\r\n    6.1.1 Весь журнал изменений, начиная либо с начала (если не было ни одного “релиза”), либо с последнего релиза, объединяется, группируется по определенному алгоритму и в результате получается так называемый diff - дельта изменений, между датой предыдущего “релиза” и текущим моментом.\r\n\r\n    6.1.2 Diff является файлом с определенной структурой, содержащий инструкции по добавлению/изменению/удалению мета-объектов кфг вместе с самими мета-объектами.\r\n\r\n    6.1.3 В журнале момент “релиза” отмечается особым образом для того, чтоб следующий diff собрать начиная с этого момента.\r\n\r\n    6.1.4 Из diff-а формируется пакет обновления, которому автоматически назначается текущая версия (при этом релизер может ее  переопределить) и предыдущая, на которую и только на которую может встать данное обновление (это делается в целях обеспечения применения инкрементальных обновлений по цепочке - одно за другим). \r\n\r\n    6.1.5 Пакет инкрементального обновления выгружается в файл\r\n\r\n6.2. Формирование и выгрузка полного обновления\r\n\r\n    6.2.1 Выгружаемой кфг-ии назначается текущая версия, при этом релизер может ее переопределить.\r\n\r\n    6.2.2 Кфг выгружается в файл\r\n\r\n7. Кфг имеет два режима - “Просмотр” и “Редактирование”. После создания кфг имеет режим по умолчанию “Редактирование”. После импорта (установки) кфг имеет режим по умолчанию “Просмотр”. Переход из режима “Просмотр” в режим “Редактирование” определяется системой защиты кфг и примененной политикой доступа к кфг. О системе защиты см. раздел “Защита кфг”. В режиме “Просмотр” в дизайнере не доступны никакие объекты кфг, имеется возможность только редактировать настройки сервера, пользователей, лицензии. В режиме “Редактирование” кфг доступна для изменения.\r\n8. Изменение кфг и выпуск обновлений доступны только в режиме “Редактирование”\r\n9. Кфг имеет признак “На поддержке”. После импорта (установки) кфг признак выставляется в true. До тех пор, пока кфг на поддержке (признак = true) - к кфг можно применять инкрементальные обновления. Кфг снимается с поддержки при внесении в нее любых изменений (в случае, если политика доступа к кфг это позволяет). В этом случае, при переходе в режим “Редактирование” признак будет сброшен в false, в результате чего инкрементальные обновления применять больше будет нельзя. После создания кфг признак выставляется в false, таким образом, у разработчика кфг (у того, кто ее создал) не будет возможности применять инкрементальные обновления, но это ему не нужно по определению, т.к. он сам выпускает эти обновления.\r\n10. В механизм применения обновлений нужно встроить возможность переноса данных между каталогами/полями. Инкрементальные обновления при этом должны содержать соответствующие инструкции по переносу данных.\r\n11. Необходимо установление соответствия между мета-объектами старой и новой кфг - как вариант, введение GUID для ключевых (или для всех) узлов кфг (мета-объектов системы)\r\n\r\n**Защита кфг**\r\n\r\nЦели и задачи, преследуемые системой по защите кфг:\r\n\r\n1. Система должна контролировать подлинность кфг, то есть быть уверенной в том, что кфг поставляется от того, от кого ожидается\r\n\r\n2. Система должна обеспечивать целостность кфг, то есть исключить в ней  несанкционированные изменения\r\n\r\n3. Реализовать политику доступа к кфг, определяющую возможность просмотра/редактирования мета-объектов, скриптов\r\n\r\n3.1. Просмотр - модификаторы доступа к мета-объектов (public/private). Public объекты можно просматривать, private - скрыты.\r\n\r\n3.2. Редактирование - разрешить изменять кфг только Поставщику (по умолчанию) и тем, кому автор даст явное разрешение.\r\n\r\n\r\nеще?...\r\n\r\nМероприятия по достижению поставленных целей и задач:\r\n\r\n1. Необходимо создать web-сервис, содержащий реестр соответствий зарегистрированных кфг и выданных им сертификатов. Должен иметь возможность выдавать публичный сертификат для запрошенной конфигурации (по SSL).\r\n\r\n2. При создании кфг генерируется пара публичный-приватный ключ с сертификатом публичного ключа. Сертификат должен быть заверен корневым CA. Публичный ключ регистрируется на web-сервисе.\r\n\r\n3. При каждом “релизе” инкрементальное и полное обновление подписываются приватным ключом, подпись сохраняется в обновлении\r\n\r\n4.  При установке обновления (инкр. или полного) Omega-сервер делает запрос к web-сервису для получения сертификата публичного ключа, соответствующего обновляемой кфг. Из сертификата извлекается публичный ключ, с помощью которого выполняется проверка подписи обновления. Таким образом обеспечивается контроль подлинности обновлений.\r\n\r\n\r\n**Работа с данными (массовая выгрузка/загрузка)**\r\n\r\nРабота с данными в контексте выгрузки/загрузки подразумевает два сценария:\r\n\r\n1. Работа с пользовательскими данными\r\nПользовательские данные - это данные предметной области, реализованной в кфг. Это данные, необходимые пользователям кфг (пример: Заказы, Клиенты, Лицензии и т.д.)\r\n\r\n1. Работа с системными данными\r\nСистемные данные - это данные, необходимые для корректной работы кфг. Это могут быть перечисления (пример: Страны, Языки), классификаторы (пример: КЛАДР, МКБ).\r\n\r\n\r\nДля реализации массовой выгрузки/загрузки по 1 сценарию нужны фильтры, нужны галочки: какие каталоги выгружать, какие не надо, и это должно выгружаться из клиента - этим нужно пользователям (например, бухгалтера - для обмена данными). Ну и для бекапа, в частности. При выгрузке кфг такие данные выгружать в общем случае, не нужно. Даже если, например, и нужно перенести пользовательские данные вместе с кфг на другой сервер, то можно выгрузить кфг и данные отдельно друг от друга - это уже частный случай.\r\n\r\nДля реализации массовой выгрузки/загрузки по 2 сценарию фильтры, галочки и прочее не нужны, т.к. это системные данные, и они нужны ВСЕ по определению (иначе система будет работать неправильно). Перечисления, как вариант, должны быть встроены в кфг (или хранящиеся в БД/файле рядом с кфг) - пары ключ-значение (может с доп.атрибутами). Их уже нужно выгружать/загружать вместе с кфг. Если Перечисления хранить в каталогах, то нужно помечать такие каталоги, как системные, и тоже выгружать/загружать их вместе с кфг.','Механизм обновления и защиты конфигураций Omega'),(85,29,'','',NULL,NULL,'2013-11-07 10:13:41','2013-11-07 10:13:41',84,0,0,8,'**Изменения, обновления и версионность КФГ**\r\n\r\n1.    Номер версии состоит из 4 цифр - “A.B.C.D”\r\n2.    При создании кфг ей назначается текущая версия “0.1.0.0” (по умолчанию, в момент создания можно переопределить). Того, кто ее создал (автор), назовем Поставщик.\r\n3.    При создании кфг на сервере (предположительно, в БД) создается журнал изменений кфг \r\n4.    Каждое изменение кфг через дизайнер (любым пользователем) записывается в журнал изменений. Туда заносится дата/время изменения, тип изменения (add/edit/delete), измененный мета-объект и юзер, выполнивший изменение.\r\n5.    После внесения всех запланированных изменений в кфг, текущая версия “релизится”\r\n6.    Процесс “релиза” заключается в следующем:\r\n\r\n6.1. Формирование и выгрузка инкрементального обновления кфг\r\n\r\n    6.1.1 Весь журнал изменений, начиная либо с начала (если не было ни одного “релиза”), либо с последнего релиза, объединяется, группируется по определенному алгоритму и в результате получается так называемый diff - дельта изменений, между датой предыдущего “релиза” и текущим моментом.\r\n\r\n    6.1.2 Diff является файлом с определенной структурой, содержащий инструкции по добавлению/изменению/удалению мета-объектов кфг вместе с самими мета-объектами.\r\n\r\n    6.1.3 В журнале момент “релиза” отмечается особым образом для того, чтоб следующий diff собрать начиная с этого момента.\r\n\r\n    6.1.4 Из diff-а формируется пакет обновления, которому автоматически назначается текущая версия (при этом релизер может ее  переопределить) и предыдущая, на которую и только на которую может встать данное обновление (это делается в целях обеспечения применения инкрементальных обновлений по цепочке - одно за другим). \r\n\r\n    6.1.5 Пакет инкрементального обновления выгружается в файл\r\n\r\n6.2. Формирование и выгрузка полного обновления\r\n\r\n    6.2.1 Выгружаемой кфг-ии назначается текущая версия, при этом релизер может ее переопределить.\r\n\r\n    6.2.2 Кфг выгружается в файл\r\n\r\n7. Кфг имеет два режима - “Просмотр” и “Редактирование”. После создания кфг имеет режим по умолчанию “Редактирование”. После импорта (установки) кфг имеет режим по умолчанию “Просмотр”. Переход из режима “Просмотр” в режим “Редактирование” определяется системой защиты кфг и примененной политикой доступа к кфг. О системе защиты см. раздел “Защита кфг”. В режиме “Просмотр” в дизайнере не доступны никакие объекты кфг, имеется возможность только редактировать настройки сервера, пользователей, лицензии. В режиме “Редактирование” кфг доступна для изменения.\r\n8. Изменение кфг и выпуск обновлений доступны только в режиме “Редактирование”\r\n9. Кфг имеет признак “На поддержке”. После импорта (установки) кфг признак выставляется в true. До тех пор, пока кфг на поддержке (признак = true) - к кфг можно применять инкрементальные обновления. Кфг снимается с поддержки при внесении в нее любых изменений (в случае, если политика доступа к кфг это позволяет). В этом случае, при переходе в режим “Редактирование” признак будет сброшен в false, в результате чего инкрементальные обновления применять больше будет нельзя. После создания кфг признак выставляется в false, таким образом, у разработчика кфг (у того, кто ее создал) не будет возможности применять инкрементальные обновления, но это ему не нужно по определению, т.к. он сам выпускает эти обновления.\r\n10. В механизм применения обновлений нужно встроить возможность переноса данных между каталогами/полями. Инкрементальные обновления при этом должны содержать соответствующие инструкции по переносу данных.\r\n11. Необходимо установление соответствия между мета-объектами старой и новой кфг - как вариант, введение GUID для ключевых (или для всех) узлов кфг (мета-объектов системы)\r\n\r\n**Защита кфг**\r\n\r\nЦели и задачи, преследуемые системой по защите кфг:\r\n\r\n1. Система должна контролировать подлинность кфг, то есть быть уверенной в том, что кфг поставляется от того, от кого ожидается\r\n\r\n2. Система должна обеспечивать целостность кфг, то есть исключить в ней  несанкционированные изменения\r\n\r\n3. Реализовать политику доступа к кфг, определяющую возможность просмотра/редактирования мета-объектов, скриптов\r\n\r\n3.1. Просмотр - модификаторы доступа к мета-объектов (public/private). Public объекты можно просматривать, private - скрыты.\r\n\r\n3.2. Редактирование - разрешить изменять кфг только Поставщику (по умолчанию) и тем, кому автор даст явное разрешение.\r\n\r\n\r\nеще?...\r\n\r\nМероприятия по достижению поставленных целей и задач:\r\n\r\n1. Необходимо создать web-сервис, содержащий реестр соответствий зарегистрированных кфг и выданных им сертификатов. Должен иметь возможность выдавать публичный сертификат для запрошенной конфигурации (по SSL).\r\n\r\n2. При создании кфг генерируется пара публичный-приватный ключ с сертификатом публичного ключа. Сертификат должен быть заверен корневым CA. Публичный ключ регистрируется на web-сервисе.\r\n\r\n3. При каждом “релизе” инкрементальное и полное обновление подписываются приватным ключом, подпись сохраняется в обновлении\r\n\r\n4.  При установке обновления (инкр. или полного) Omega-сервер делает запрос к web-сервису для получения сертификата публичного ключа, соответствующего обновляемой кфг. Из сертификата извлекается публичный ключ, с помощью которого выполняется проверка подписи обновления. Таким образом обеспечивается контроль подлинности обновлений.\r\n\r\n\r\n**Работа с данными (массовая выгрузка/загрузка)**\r\n\r\nРабота с данными в контексте выгрузки/загрузки подразумевает два сценария:\r\n\r\n1. Работа с пользовательскими данными\r\nПользовательские данные - это данные предметной области, реализованной в кфг. Это данные, необходимые пользователям кфг (пример: Заказы, Клиенты, Лицензии и т.д.)\r\n\r\n1. Работа с системными данными\r\nСистемные данные - это данные, необходимые для корректной работы кфг. Это могут быть перечисления (пример: Страны, Языки), классификаторы (пример: КЛАДР, МКБ).\r\n\r\n\r\nДля реализации массовой выгрузки/загрузки по 1 сценарию нужны фильтры, нужны галочки: какие каталоги выгружать, какие не надо, и это должно выгружаться из клиента - этим нужно пользователям (например, бухгалтера - для обмена данными). Ну и для бекапа, в частности. При выгрузке кфг такие данные выгружать в общем случае, не нужно. Даже если, например, и нужно перенести пользовательские данные вместе с кфг на другой сервер, то можно выгрузить кфг и данные отдельно друг от друга - это уже частный случай.\r\n\r\nДля реализации массовой выгрузки/загрузки по 2 сценарию фильтры, галочки и прочее не нужны, т.к. это системные данные, и они нужны ВСЕ по определению (иначе система будет работать неправильно). Перечисления, как вариант, должны быть встроены в кфг (или хранящиеся в БД/файле рядом с кфг) - пары ключ-значение (может с доп.атрибутами). Их уже нужно выгружать/загружать вместе с кфг. Если Перечисления хранить в каталогах, то нужно помечать такие каталоги, как системные, и тоже выгружать/загружать их вместе с кфг.','Механизм обновления и защиты конфигураций Omega'),(86,30,'','',NULL,NULL,'2013-11-07 10:16:10','2013-11-07 10:16:10',85,0,0,8,'**Изменения, обновления и версионность КФГ**\r\n\r\n 1.    Номер версии состоит из 4 цифр - “A.B.C.D”\r\n 2.    При создании кфг ей назначается текущая версия “0.1.0.0” (по умолчанию, в момент создания можно переопределить). Того, кто ее создал (автор), назовем Поставщик.\r\n 3.    При создании кфг на сервере (предположительно, в БД) создается журнал изменений кфг \r\n 4.    Каждое изменение кфг через дизайнер (любым пользователем) записывается в журнал изменений. Туда заносится дата/время изменения, тип изменения (add/edit/delete), измененный мета-объект и юзер, выполнивший изменение.\r\n 5.    После внесения всех запланированных изменений в кфг, текущая версия “релизится”\r\n 6.    Процесс “релиза” заключается в следующем:\r\n\r\n6.1. Формирование и выгрузка инкрементального обновления кфг\r\n\r\n    6.1.1 Весь журнал изменений, начиная либо с начала (если не было ни одного “релиза”), либо с последнего релиза, объединяется, группируется по определенному алгоритму и в результате получается так называемый diff - дельта изменений, между датой предыдущего “релиза” и текущим моментом.\r\n\r\n    6.1.2 Diff является файлом с определенной структурой, содержащий инструкции по добавлению/изменению/удалению мета-объектов кфг вместе с самими мета-объектами.\r\n\r\n    6.1.3 В журнале момент “релиза” отмечается особым образом для того, чтоб следующий diff собрать начиная с этого момента.\r\n\r\n    6.1.4 Из diff-а формируется пакет обновления, которому автоматически назначается текущая версия (при этом релизер может ее  переопределить) и предыдущая, на которую и только на которую может встать данное обновление (это делается в целях обеспечения применения инкрементальных обновлений по цепочке - одно за другим). \r\n\r\n    6.1.5 Пакет инкрементального обновления выгружается в файл\r\n\r\n6.2. Формирование и выгрузка полного обновления\r\n\r\n    6.2.1 Выгружаемой кфг-ии назначается текущая версия, при этом релизер может ее переопределить.\r\n\r\n    6.2.2 Кфг выгружается в файл\r\n\r\n7. Кфг имеет два режима - “Просмотр” и “Редактирование”. После создания кфг имеет режим по умолчанию “Редактирование”. После импорта (установки) кфг имеет режим по умолчанию “Просмотр”. Переход из режима “Просмотр” в режим “Редактирование” определяется системой защиты кфг и примененной политикой доступа к кфг. О системе защиты см. раздел “Защита кфг”. В режиме “Просмотр” в дизайнере не доступны никакие объекты кфг, имеется возможность только редактировать настройки сервера, пользователей, лицензии. В режиме “Редактирование” кфг доступна для изменения.\r\n8. Изменение кфг и выпуск обновлений доступны только в режиме “Редактирование”\r\n9. Кфг имеет признак “На поддержке”. После импорта (установки) кфг признак выставляется в true. До тех пор, пока кфг на поддержке (признак = true) - к кфг можно применять инкрементальные обновления. Кфг снимается с поддержки при внесении в нее любых изменений (в случае, если политика доступа к кфг это позволяет). В этом случае, при переходе в режим “Редактирование” признак будет сброшен в false, в результате чего инкрементальные обновления применять больше будет нельзя. После создания кфг признак выставляется в false, таким образом, у разработчика кфг (у того, кто ее создал) не будет возможности применять инкрементальные обновления, но это ему не нужно по определению, т.к. он сам выпускает эти обновления.\r\n10. В механизм применения обновлений нужно встроить возможность переноса данных между каталогами/полями. Инкрементальные обновления при этом должны содержать соответствующие инструкции по переносу данных.\r\n11. Необходимо установление соответствия между мета-объектами старой и новой кфг - как вариант, введение GUID для ключевых (или для всех) узлов кфг (мета-объектов системы)\r\n\r\n**Защита кфг**\r\n\r\nЦели и задачи, преследуемые системой по защите кфг:\r\n\r\n1. Система должна контролировать подлинность кфг, то есть быть уверенной в том, что кфг поставляется от того, от кого ожидается\r\n\r\n2. Система должна обеспечивать целостность кфг, то есть исключить в ней  несанкционированные изменения\r\n\r\n3. Реализовать политику доступа к кфг, определяющую возможность просмотра/редактирования мета-объектов, скриптов\r\n\r\n3.1. Просмотр - модификаторы доступа к мета-объектов (public/private). Public объекты можно просматривать, private - скрыты.\r\n\r\n3.2. Редактирование - разрешить изменять кфг только Поставщику (по умолчанию) и тем, кому автор даст явное разрешение.\r\n\r\n\r\nеще?...\r\n\r\nМероприятия по достижению поставленных целей и задач:\r\n\r\n1. Необходимо создать web-сервис, содержащий реестр соответствий зарегистрированных кфг и выданных им сертификатов. Должен иметь возможность выдавать публичный сертификат для запрошенной конфигурации (по SSL).\r\n\r\n2. При создании кфг генерируется пара публичный-приватный ключ с сертификатом публичного ключа. Сертификат должен быть заверен корневым CA. Публичный ключ регистрируется на web-сервисе.\r\n\r\n3. При каждом “релизе” инкрементальное и полное обновление подписываются приватным ключом, подпись сохраняется в обновлении\r\n\r\n4.  При установке обновления (инкр. или полного) Omega-сервер делает запрос к web-сервису для получения сертификата публичного ключа, соответствующего обновляемой кфг. Из сертификата извлекается публичный ключ, с помощью которого выполняется проверка подписи обновления. Таким образом обеспечивается контроль подлинности обновлений.\r\n\r\n\r\n**Работа с данными (массовая выгрузка/загрузка)**\r\n\r\nРабота с данными в контексте выгрузки/загрузки подразумевает два сценария:\r\n\r\n1. Работа с пользовательскими данными\r\nПользовательские данные - это данные предметной области, реализованной в кфг. Это данные, необходимые пользователям кфг (пример: Заказы, Клиенты, Лицензии и т.д.)\r\n\r\n1. Работа с системными данными\r\nСистемные данные - это данные, необходимые для корректной работы кфг. Это могут быть перечисления (пример: Страны, Языки), классификаторы (пример: КЛАДР, МКБ).\r\n\r\n\r\nДля реализации массовой выгрузки/загрузки по 1 сценарию нужны фильтры, нужны галочки: какие каталоги выгружать, какие не надо, и это должно выгружаться из клиента - этим нужно пользователям (например, бухгалтера - для обмена данными). Ну и для бекапа, в частности. При выгрузке кфг такие данные выгружать в общем случае, не нужно. Даже если, например, и нужно перенести пользовательские данные вместе с кфг на другой сервер, то можно выгрузить кфг и данные отдельно друг от друга - это уже частный случай.\r\n\r\nДля реализации массовой выгрузки/загрузки по 2 сценарию фильтры, галочки и прочее не нужны, т.к. это системные данные, и они нужны ВСЕ по определению (иначе система будет работать неправильно). Перечисления, как вариант, должны быть встроены в кфг (или хранящиеся в БД/файле рядом с кфг) - пары ключ-значение (может с доп.атрибутами). Их уже нужно выгружать/загружать вместе с кфг. Если Перечисления хранить в каталогах, то нужно помечать такие каталоги, как системные, и тоже выгружать/загружать их вместе с кфг.','Механизм обновления и защиты конфигураций Omega'),(87,31,'','',NULL,NULL,'2013-11-07 10:16:49','2013-11-07 10:16:49',86,0,0,8,'**Изменения, обновления и версионность КФГ**\r\n\r\n   1.    Номер версии состоит из 4 цифр - “A.B.C.D”\r\n   2.    При создании кфг ей назначается текущая версия “0.1.0.0” (по умолчанию, в момент создания можно переопределить). Того, кто ее создал (автор), назовем Поставщик.\r\n   3.    При создании кфг на сервере (предположительно, в БД) создается журнал изменений кфг \r\n   4.    Каждое изменение кфг через дизайнер (любым пользователем) записывается в журнал изменений. Туда заносится дата/время изменения, тип изменения (add/edit/delete), измененный мета-объект и юзер, выполнивший изменение.\r\n   5.    После внесения всех запланированных изменений в кфг, текущая версия “релизится”\r\n	6.    Процесс “релиза” заключается в следующем:\r\n\r\n6.1. Формирование и выгрузка инкрементального обновления кфг\r\n\r\n    6.1.1 Весь журнал изменений, начиная либо с начала (если не было ни одного “релиза”), либо с последнего релиза, объединяется, группируется по определенному алгоритму и в результате получается так называемый diff - дельта изменений, между датой предыдущего “релиза” и текущим моментом.\r\n\r\n    6.1.2 Diff является файлом с определенной структурой, содержащий инструкции по добавлению/изменению/удалению мета-объектов кфг вместе с самими мета-объектами.\r\n\r\n    6.1.3 В журнале момент “релиза” отмечается особым образом для того, чтоб следующий diff собрать начиная с этого момента.\r\n\r\n    6.1.4 Из diff-а формируется пакет обновления, которому автоматически назначается текущая версия (при этом релизер может ее  переопределить) и предыдущая, на которую и только на которую может встать данное обновление (это делается в целях обеспечения применения инкрементальных обновлений по цепочке - одно за другим). \r\n\r\n    6.1.5 Пакет инкрементального обновления выгружается в файл\r\n\r\n6.2. Формирование и выгрузка полного обновления\r\n\r\n    6.2.1 Выгружаемой кфг-ии назначается текущая версия, при этом релизер может ее переопределить.\r\n\r\n    6.2.2 Кфг выгружается в файл\r\n\r\n7. Кфг имеет два режима - “Просмотр” и “Редактирование”. После создания кфг имеет режим по умолчанию “Редактирование”. После импорта (установки) кфг имеет режим по умолчанию “Просмотр”. Переход из режима “Просмотр” в режим “Редактирование” определяется системой защиты кфг и примененной политикой доступа к кфг. О системе защиты см. раздел “Защита кфг”. В режиме “Просмотр” в дизайнере не доступны никакие объекты кфг, имеется возможность только редактировать настройки сервера, пользователей, лицензии. В режиме “Редактирование” кфг доступна для изменения.\r\n8. Изменение кфг и выпуск обновлений доступны только в режиме “Редактирование”\r\n9. Кфг имеет признак “На поддержке”. После импорта (установки) кфг признак выставляется в true. До тех пор, пока кфг на поддержке (признак = true) - к кфг можно применять инкрементальные обновления. Кфг снимается с поддержки при внесении в нее любых изменений (в случае, если политика доступа к кфг это позволяет). В этом случае, при переходе в режим “Редактирование” признак будет сброшен в false, в результате чего инкрементальные обновления применять больше будет нельзя. После создания кфг признак выставляется в false, таким образом, у разработчика кфг (у того, кто ее создал) не будет возможности применять инкрементальные обновления, но это ему не нужно по определению, т.к. он сам выпускает эти обновления.\r\n10. В механизм применения обновлений нужно встроить возможность переноса данных между каталогами/полями. Инкрементальные обновления при этом должны содержать соответствующие инструкции по переносу данных.\r\n11. Необходимо установление соответствия между мета-объектами старой и новой кфг - как вариант, введение GUID для ключевых (или для всех) узлов кфг (мета-объектов системы)\r\n\r\n**Защита кфг**\r\n\r\nЦели и задачи, преследуемые системой по защите кфг:\r\n\r\n1. Система должна контролировать подлинность кфг, то есть быть уверенной в том, что кфг поставляется от того, от кого ожидается\r\n\r\n2. Система должна обеспечивать целостность кфг, то есть исключить в ней  несанкционированные изменения\r\n\r\n3. Реализовать политику доступа к кфг, определяющую возможность просмотра/редактирования мета-объектов, скриптов\r\n\r\n3.1. Просмотр - модификаторы доступа к мета-объектов (public/private). Public объекты можно просматривать, private - скрыты.\r\n\r\n3.2. Редактирование - разрешить изменять кфг только Поставщику (по умолчанию) и тем, кому автор даст явное разрешение.\r\n\r\n\r\nеще?...\r\n\r\nМероприятия по достижению поставленных целей и задач:\r\n\r\n1. Необходимо создать web-сервис, содержащий реестр соответствий зарегистрированных кфг и выданных им сертификатов. Должен иметь возможность выдавать публичный сертификат для запрошенной конфигурации (по SSL).\r\n\r\n2. При создании кфг генерируется пара публичный-приватный ключ с сертификатом публичного ключа. Сертификат должен быть заверен корневым CA. Публичный ключ регистрируется на web-сервисе.\r\n\r\n3. При каждом “релизе” инкрементальное и полное обновление подписываются приватным ключом, подпись сохраняется в обновлении\r\n\r\n4.  При установке обновления (инкр. или полного) Omega-сервер делает запрос к web-сервису для получения сертификата публичного ключа, соответствующего обновляемой кфг. Из сертификата извлекается публичный ключ, с помощью которого выполняется проверка подписи обновления. Таким образом обеспечивается контроль подлинности обновлений.\r\n\r\n\r\n**Работа с данными (массовая выгрузка/загрузка)**\r\n\r\nРабота с данными в контексте выгрузки/загрузки подразумевает два сценария:\r\n\r\n1. Работа с пользовательскими данными\r\nПользовательские данные - это данные предметной области, реализованной в кфг. Это данные, необходимые пользователям кфг (пример: Заказы, Клиенты, Лицензии и т.д.)\r\n\r\n1. Работа с системными данными\r\nСистемные данные - это данные, необходимые для корректной работы кфг. Это могут быть перечисления (пример: Страны, Языки), классификаторы (пример: КЛАДР, МКБ).\r\n\r\n\r\nДля реализации массовой выгрузки/загрузки по 1 сценарию нужны фильтры, нужны галочки: какие каталоги выгружать, какие не надо, и это должно выгружаться из клиента - этим нужно пользователям (например, бухгалтера - для обмена данными). Ну и для бекапа, в частности. При выгрузке кфг такие данные выгружать в общем случае, не нужно. Даже если, например, и нужно перенести пользовательские данные вместе с кфг на другой сервер, то можно выгрузить кфг и данные отдельно друг от друга - это уже частный случай.\r\n\r\nДля реализации массовой выгрузки/загрузки по 2 сценарию фильтры, галочки и прочее не нужны, т.к. это системные данные, и они нужны ВСЕ по определению (иначе система будет работать неправильно). Перечисления, как вариант, должны быть встроены в кфг (или хранящиеся в БД/файле рядом с кфг) - пары ключ-значение (может с доп.атрибутами). Их уже нужно выгружать/загружать вместе с кфг. Если Перечисления хранить в каталогах, то нужно помечать такие каталоги, как системные, и тоже выгружать/загружать их вместе с кфг.','Механизм обновления и защиты конфигураций Omega'),(88,32,'','',NULL,NULL,'2013-11-07 10:17:57','2013-11-07 10:17:57',87,0,0,8,'**Изменения, обновления и версионность КФГ**\r\n\r\n1. Номер версии состоит из 4 цифр - “A.B.C.D”\r\n2. При создании кфг ей назначается текущая версия “0.1.0.0” (по умолчанию, в момент создания можно переопределить). Того, кто ее создал (автор), назовем Поставщик.\r\n3. При создании кфг на сервере (предположительно, в БД) создается журнал изменений кфг \r\n4. Каждое изменение кфг через дизайнер (любым пользователем) записывается в журнал изменений. Туда заносится дата/время изменения, тип изменения (add/edit/delete), измененный мета-объект и юзер, выполнивший изменение.\r\n5. После внесения всех запланированных изменений в кфг, текущая версия “релизится”\r\n	6. Процесс “релиза” заключается в следующем:\r\n\r\n6.1. Формирование и выгрузка инкрементального обновления кфг\r\n\r\n    6.1.1 Весь журнал изменений, начиная либо с начала (если не было ни одного “релиза”), либо с последнего релиза, объединяется, группируется по определенному алгоритму и в результате получается так называемый diff - дельта изменений, между датой предыдущего “релиза” и текущим моментом.\r\n\r\n    6.1.2 Diff является файлом с определенной структурой, содержащий инструкции по добавлению/изменению/удалению мета-объектов кфг вместе с самими мета-объектами.\r\n\r\n    6.1.3 В журнале момент “релиза” отмечается особым образом для того, чтоб следующий diff собрать начиная с этого момента.\r\n\r\n    6.1.4 Из diff-а формируется пакет обновления, которому автоматически назначается текущая версия (при этом релизер может ее  переопределить) и предыдущая, на которую и только на которую может встать данное обновление (это делается в целях обеспечения применения инкрементальных обновлений по цепочке - одно за другим). \r\n\r\n    6.1.5 Пакет инкрементального обновления выгружается в файл\r\n\r\n6.2. Формирование и выгрузка полного обновления\r\n\r\n    6.2.1 Выгружаемой кфг-ии назначается текущая версия, при этом релизер может ее переопределить.\r\n\r\n    6.2.2 Кфг выгружается в файл\r\n\r\n7. Кфг имеет два режима - “Просмотр” и “Редактирование”. После создания кфг имеет режим по умолчанию “Редактирование”. После импорта (установки) кфг имеет режим по умолчанию “Просмотр”. Переход из режима “Просмотр” в режим “Редактирование” определяется системой защиты кфг и примененной политикой доступа к кфг. О системе защиты см. раздел “Защита кфг”. В режиме “Просмотр” в дизайнере не доступны никакие объекты кфг, имеется возможность только редактировать настройки сервера, пользователей, лицензии. В режиме “Редактирование” кфг доступна для изменения.\r\n8. Изменение кфг и выпуск обновлений доступны только в режиме “Редактирование”\r\n9. Кфг имеет признак “На поддержке”. После импорта (установки) кфг признак выставляется в true. До тех пор, пока кфг на поддержке (признак = true) - к кфг можно применять инкрементальные обновления. Кфг снимается с поддержки при внесении в нее любых изменений (в случае, если политика доступа к кфг это позволяет). В этом случае, при переходе в режим “Редактирование” признак будет сброшен в false, в результате чего инкрементальные обновления применять больше будет нельзя. После создания кфг признак выставляется в false, таким образом, у разработчика кфг (у того, кто ее создал) не будет возможности применять инкрементальные обновления, но это ему не нужно по определению, т.к. он сам выпускает эти обновления.\r\n10. В механизм применения обновлений нужно встроить возможность переноса данных между каталогами/полями. Инкрементальные обновления при этом должны содержать соответствующие инструкции по переносу данных.\r\n11. Необходимо установление соответствия между мета-объектами старой и новой кфг - как вариант, введение GUID для ключевых (или для всех) узлов кфг (мета-объектов системы)\r\n\r\n**Защита кфг**\r\n\r\nЦели и задачи, преследуемые системой по защите кфг:\r\n\r\n1. Система должна контролировать подлинность кфг, то есть быть уверенной в том, что кфг поставляется от того, от кого ожидается\r\n\r\n2. Система должна обеспечивать целостность кфг, то есть исключить в ней  несанкционированные изменения\r\n\r\n3. Реализовать политику доступа к кфг, определяющую возможность просмотра/редактирования мета-объектов, скриптов\r\n\r\n3.1. Просмотр - модификаторы доступа к мета-объектов (public/private). Public объекты можно просматривать, private - скрыты.\r\n\r\n3.2. Редактирование - разрешить изменять кфг только Поставщику (по умолчанию) и тем, кому автор даст явное разрешение.\r\n\r\n\r\nеще?...\r\n\r\nМероприятия по достижению поставленных целей и задач:\r\n\r\n1. Необходимо создать web-сервис, содержащий реестр соответствий зарегистрированных кфг и выданных им сертификатов. Должен иметь возможность выдавать публичный сертификат для запрошенной конфигурации (по SSL).\r\n\r\n2. При создании кфг генерируется пара публичный-приватный ключ с сертификатом публичного ключа. Сертификат должен быть заверен корневым CA. Публичный ключ регистрируется на web-сервисе.\r\n\r\n3. При каждом “релизе” инкрементальное и полное обновление подписываются приватным ключом, подпись сохраняется в обновлении\r\n\r\n4.  При установке обновления (инкр. или полного) Omega-сервер делает запрос к web-сервису для получения сертификата публичного ключа, соответствующего обновляемой кфг. Из сертификата извлекается публичный ключ, с помощью которого выполняется проверка подписи обновления. Таким образом обеспечивается контроль подлинности обновлений.\r\n\r\n\r\n**Работа с данными (массовая выгрузка/загрузка)**\r\n\r\nРабота с данными в контексте выгрузки/загрузки подразумевает два сценария:\r\n\r\n1. Работа с пользовательскими данными\r\nПользовательские данные - это данные предметной области, реализованной в кфг. Это данные, необходимые пользователям кфг (пример: Заказы, Клиенты, Лицензии и т.д.)\r\n\r\n1. Работа с системными данными\r\nСистемные данные - это данные, необходимые для корректной работы кфг. Это могут быть перечисления (пример: Страны, Языки), классификаторы (пример: КЛАДР, МКБ).\r\n\r\n\r\nДля реализации массовой выгрузки/загрузки по 1 сценарию нужны фильтры, нужны галочки: какие каталоги выгружать, какие не надо, и это должно выгружаться из клиента - этим нужно пользователям (например, бухгалтера - для обмена данными). Ну и для бекапа, в частности. При выгрузке кфг такие данные выгружать в общем случае, не нужно. Даже если, например, и нужно перенести пользовательские данные вместе с кфг на другой сервер, то можно выгрузить кфг и данные отдельно друг от друга - это уже частный случай.\r\n\r\nДля реализации массовой выгрузки/загрузки по 2 сценарию фильтры, галочки и прочее не нужны, т.к. это системные данные, и они нужны ВСЕ по определению (иначе система будет работать неправильно). Перечисления, как вариант, должны быть встроены в кфг (или хранящиеся в БД/файле рядом с кфг) - пары ключ-значение (может с доп.атрибутами). Их уже нужно выгружать/загружать вместе с кфг. Если Перечисления хранить в каталогах, то нужно помечать такие каталоги, как системные, и тоже выгружать/загружать их вместе с кфг.','Механизм обновления и защиты конфигураций Omega'),(89,33,'','',NULL,NULL,'2013-11-07 10:18:46','2013-11-07 10:18:46',88,0,0,8,'**Изменения, обновления и версионность КФГ**\r\n\r\n1. Номер версии состоит из 4 цифр - “A.B.C.D”\r\n2. При создании кфг ей назначается текущая версия “0.1.0.0” (по умолчанию, в момент создания можно переопределить). Того, кто ее создал (автор), назовем Поставщик.\r\n3. При создании кфг на сервере (предположительно, в БД) создается журнал изменений кфг \r\n4. Каждое изменение кфг через дизайнер (любым пользователем) записывается в журнал изменений. Туда заносится дата/время изменения, тип изменения (add/edit/delete), измененный мета-объект и юзер, выполнивший изменение.\r\n5. После внесения всех запланированных изменений в кфг, текущая версия “релизится”\r\n6. Процесс “релиза” заключается в следующем:\r\n\r\n6.1. Формирование и выгрузка инкрементального обновления кфг\r\n\r\n    6.1.1 Весь журнал изменений, начиная либо с начала (если не было ни одного “релиза”), либо с последнего релиза, объединяется, группируется по определенному алгоритму и в результате получается так называемый diff - дельта изменений, между датой предыдущего “релиза” и текущим моментом.\r\n\r\n    6.1.2 Diff является файлом с определенной структурой, содержащий инструкции по добавлению/изменению/удалению мета-объектов кфг вместе с самими мета-объектами.\r\n\r\n    6.1.3 В журнале момент “релиза” отмечается особым образом для того, чтоб следующий diff собрать начиная с этого момента.\r\n\r\n    6.1.4 Из diff-а формируется пакет обновления, которому автоматически назначается текущая версия (при этом релизер может ее  переопределить) и предыдущая, на которую и только на которую может встать данное обновление (это делается в целях обеспечения применения инкрементальных обновлений по цепочке - одно за другим). \r\n\r\n    6.1.5 Пакет инкрементального обновления выгружается в файл\r\n\r\n6.2. Формирование и выгрузка полного обновления\r\n\r\n    6.2.1 Выгружаемой кфг-ии назначается текущая версия, при этом релизер может ее переопределить.\r\n\r\n    6.2.2 Кфг выгружается в файл\r\n\r\n7. Кфг имеет два режима - “Просмотр” и “Редактирование”. После создания кфг имеет режим по умолчанию “Редактирование”. После импорта (установки) кфг имеет режим по умолчанию “Просмотр”. Переход из режима “Просмотр” в режим “Редактирование” определяется системой защиты кфг и примененной политикой доступа к кфг. О системе защиты см. раздел “Защита кфг”. В режиме “Просмотр” в дизайнере не доступны никакие объекты кфг, имеется возможность только редактировать настройки сервера, пользователей, лицензии. В режиме “Редактирование” кфг доступна для изменения.\r\n8. Изменение кфг и выпуск обновлений доступны только в режиме “Редактирование”\r\n9. Кфг имеет признак “На поддержке”. После импорта (установки) кфг признак выставляется в true. До тех пор, пока кфг на поддержке (признак = true) - к кфг можно применять инкрементальные обновления. Кфг снимается с поддержки при внесении в нее любых изменений (в случае, если политика доступа к кфг это позволяет). В этом случае, при переходе в режим “Редактирование” признак будет сброшен в false, в результате чего инкрементальные обновления применять больше будет нельзя. После создания кфг признак выставляется в false, таким образом, у разработчика кфг (у того, кто ее создал) не будет возможности применять инкрементальные обновления, но это ему не нужно по определению, т.к. он сам выпускает эти обновления.\r\n10. В механизм применения обновлений нужно встроить возможность переноса данных между каталогами/полями. Инкрементальные обновления при этом должны содержать соответствующие инструкции по переносу данных.\r\n11. Необходимо установление соответствия между мета-объектами старой и новой кфг - как вариант, введение GUID для ключевых (или для всех) узлов кфг (мета-объектов системы)\r\n\r\n**Защита кфг**\r\n\r\nЦели и задачи, преследуемые системой по защите кфг:\r\n\r\n1. Система должна контролировать подлинность кфг, то есть быть уверенной в том, что кфг поставляется от того, от кого ожидается\r\n\r\n2. Система должна обеспечивать целостность кфг, то есть исключить в ней  несанкционированные изменения\r\n\r\n3. Реализовать политику доступа к кфг, определяющую возможность просмотра/редактирования мета-объектов, скриптов\r\n\r\n3.1. Просмотр - модификаторы доступа к мета-объектов (public/private). Public объекты можно просматривать, private - скрыты.\r\n\r\n3.2. Редактирование - разрешить изменять кфг только Поставщику (по умолчанию) и тем, кому автор даст явное разрешение.\r\n\r\n\r\nеще?...\r\n\r\nМероприятия по достижению поставленных целей и задач:\r\n\r\n1. Необходимо создать web-сервис, содержащий реестр соответствий зарегистрированных кфг и выданных им сертификатов. Должен иметь возможность выдавать публичный сертификат для запрошенной конфигурации (по SSL).\r\n\r\n2. При создании кфг генерируется пара публичный-приватный ключ с сертификатом публичного ключа. Сертификат должен быть заверен корневым CA. Публичный ключ регистрируется на web-сервисе.\r\n\r\n3. При каждом “релизе” инкрементальное и полное обновление подписываются приватным ключом, подпись сохраняется в обновлении\r\n\r\n4.  При установке обновления (инкр. или полного) Omega-сервер делает запрос к web-сервису для получения сертификата публичного ключа, соответствующего обновляемой кфг. Из сертификата извлекается публичный ключ, с помощью которого выполняется проверка подписи обновления. Таким образом обеспечивается контроль подлинности обновлений.\r\n\r\n\r\n**Работа с данными (массовая выгрузка/загрузка)**\r\n\r\nРабота с данными в контексте выгрузки/загрузки подразумевает два сценария:\r\n\r\n1. Работа с пользовательскими данными\r\nПользовательские данные - это данные предметной области, реализованной в кфг. Это данные, необходимые пользователям кфг (пример: Заказы, Клиенты, Лицензии и т.д.)\r\n\r\n1. Работа с системными данными\r\nСистемные данные - это данные, необходимые для корректной работы кфг. Это могут быть перечисления (пример: Страны, Языки), классификаторы (пример: КЛАДР, МКБ).\r\n\r\n\r\nДля реализации массовой выгрузки/загрузки по 1 сценарию нужны фильтры, нужны галочки: какие каталоги выгружать, какие не надо, и это должно выгружаться из клиента - этим нужно пользователям (например, бухгалтера - для обмена данными). Ну и для бекапа, в частности. При выгрузке кфг такие данные выгружать в общем случае, не нужно. Даже если, например, и нужно перенести пользовательские данные вместе с кфг на другой сервер, то можно выгрузить кфг и данные отдельно друг от друга - это уже частный случай.\r\n\r\nДля реализации массовой выгрузки/загрузки по 2 сценарию фильтры, галочки и прочее не нужны, т.к. это системные данные, и они нужны ВСЕ по определению (иначе система будет работать неправильно). Перечисления, как вариант, должны быть встроены в кфг (или хранящиеся в БД/файле рядом с кфг) - пары ключ-значение (может с доп.атрибутами). Их уже нужно выгружать/загружать вместе с кфг. Если Перечисления хранить в каталогах, то нужно помечать такие каталоги, как системные, и тоже выгружать/загружать их вместе с кфг.','Механизм обновления и защиты конфигураций Omega'),(90,1,'','',NULL,NULL,'2013-11-07 12:00:34','2013-11-07 12:00:34',NULL,0,0,9,'Коллеги, если желаете узнать, как делать что-либо в Wiki, просьба сначала зайти на сайт разработчика - http://wiki.overtag.dk/','Инструкции по использованию Wiki и сайт разработчика'),(92,34,'','',NULL,NULL,'2013-11-15 20:08:23','2013-11-15 20:08:23',89,0,0,8,'**Изменения, обновления и версионность КФГ**\r\n\r\n1. Номер версии состоит из 4 цифр - “A.B.C.D”\r\n2. При создании кфг ей назначается текущая версия “0.1.0.0” (по умолчанию, в момент создания можно переопределить). Того, кто ее создал (автор), назовем Поставщик.\r\n3. При создании кфг на сервере (предположительно, в БД) создается журнал изменений кфг \r\n4. Каждое изменение кфг через дизайнер (любым пользователем) записывается в журнал изменений. Туда заносится дата/время изменения, тип изменения (add/edit/delete), измененный мета-объект и юзер, выполнивший изменение.\r\n5. После внесения всех запланированных изменений в кфг, текущая версия “релизится”\r\n6. Процесс “релиза” заключается в следующем:\r\n\r\n6.1. Формирование и выгрузка инкрементального обновления кфг\r\n\r\n    6.1.1 Весь журнал изменений, начиная либо с начала (если не было ни одного “релиза”), либо с последнего релиза, объединяется, группируется по определенному алгоритму и в результате получается так называемый diff - дельта изменений, между датой предыдущего “релиза” и текущим моментом.\r\n\r\n    6.1.2 Diff является файлом с определенной структурой, содержащий инструкции по добавлению/изменению/удалению мета-объектов кфг вместе с самими мета-объектами.\r\n\r\n    6.1.3 В журнале момент “релиза” отмечается особым образом для того, чтоб следующий diff собрать начиная с этого момента.\r\n\r\n    6.1.4 Из diff-а формируется пакет обновления, которому автоматически назначается текущая версия (при этом релизер может ее  переопределить) и предыдущая, на которую и только на которую может встать данное обновление (это делается в целях обеспечения применения инкрементальных обновлений по цепочке - одно за другим). \r\n\r\n    6.1.5 Пакет инкрементального обновления выгружается в файл\r\n\r\n6.2. Формирование и выгрузка полного обновления\r\n\r\n    6.2.1 Выгружаемой кфг-ии назначается текущая версия, при этом релизер может ее переопределить.\r\n\r\n    6.2.2 Кфг выгружается в файл\r\n\r\n7. Кфг имеет два режима - “Просмотр” и “Редактирование”. После создания кфг имеет режим по умолчанию “Редактирование”. После импорта (установки) кфг имеет режим по умолчанию “Просмотр”. Переход из режима “Просмотр” в режим “Редактирование” определяется системой защиты кфг и примененной политикой доступа к кфг. О системе защиты см. раздел “Защита кфг”. В режиме “Просмотр” в дизайнере не доступны никакие объекты кфг, имеется возможность только редактировать настройки сервера, пользователей, лицензии. В режиме “Редактирование” кфг доступна для изменения.\r\n8. Изменение кфг и выпуск обновлений доступны только в режиме “Редактирование”\r\n9. Кфг имеет признак “На поддержке”. После импорта (установки) кфг признак выставляется в true. До тех пор, пока кфг на поддержке (признак = true) - к кфг можно применять инкрементальные обновления. Кфг снимается с поддержки при внесении в нее любых изменений (в случае, если политика доступа к кфг это позволяет). В этом случае, при переходе в режим “Редактирование” признак будет сброшен в false, в результате чего инкрементальные обновления применять больше будет нельзя. После создания кфг признак выставляется в false, таким образом, у разработчика кфг (у того, кто ее создал) не будет возможности применять инкрементальные обновления, но это ему не нужно по определению, т.к. он сам выпускает эти обновления.\r\n10. В механизм применения обновлений нужно встроить возможность переноса данных между каталогами/полями. Инкрементальные обновления при этом должны содержать соответствующие инструкции по переносу данных.\r\n11. Необходимо установление соответствия между мета-объектами старой и новой кфг - как вариант, введение GUID для ключевых (или для всех) узлов кфг (мета-объектов системы)\r\n\r\n**Защита кфг**\r\n\r\nЦели и задачи, преследуемые системой по защите кфг:\r\n\r\n1. Система должна контролировать подлинность кфг, то есть быть уверенной в том, что кфг поставляется от того, от кого ожидается\r\n\r\n2. Система должна обеспечивать целостность кфг, то есть исключить в ней  несанкционированные изменения\r\n\r\n3. Реализовать политику доступа к кфг, определяющую возможность просмотра/редактирования мета-объектов, скриптов\r\n\r\n3.1. Просмотр - модификаторы доступа к мета-объектов (public/private). Public объекты можно просматривать, private - скрыты.\r\n\r\n3.2. Редактирование - разрешить изменять кфг только Поставщику (по умолчанию) и тем, кому автор даст явное разрешение.\r\n\r\n\r\nеще?...\r\n\r\nМероприятия по достижению поставленных целей и задач:\r\n\r\n1. Необходимо создать web-сервис, содержащий реестр соответствий зарегистрированных кфг и выданных им сертификатов. Должен иметь возможность выдавать публичный сертификат для запрошенной конфигурации (по SSL).\r\n\r\n2. При создании кфг генерируется пара публичный-приватный ключ с сертификатом публичного ключа. Сертификат должен быть заверен корневым CA. Публичный ключ регистрируется на web-сервисе.\r\n\r\n3. При каждом “релизе” инкрементальное и полное обновление подписываются приватным ключом, подпись сохраняется в обновлении\r\n\r\n4.  При установке обновления (инкр. или полного) Omega-сервер делает запрос к web-сервису для получения сертификата публичного ключа, соответствующего обновляемой кфг. Из сертификата извлекается публичный ключ, с помощью которого выполняется проверка подписи обновления. Таким образом обеспечивается контроль подлинности обновлений.\r\n\r\n\r\n**Работа с данными (массовая выгрузка/загрузка)**\r\n\r\nРабота с данными в контексте выгрузки/загрузки подразумевает два сценария:\r\n\r\n1. Работа с пользовательскими данными\r\nПользовательские данные - это данные предметной области, реализованной в кфг. Это данные, необходимые пользователям кфг (пример: Заказы, Клиенты, Лицензии и т.д.)\r\n\r\n1. Работа с системными данными\r\nСистемные данные - это данные, необходимые для корректной работы кфг. Это могут быть перечисления (пример: Страны, Языки), классификаторы (пример: КЛАДР, МКБ).\r\n\r\n\r\nДля реализации массовой выгрузки/загрузки по 1 сценарию нужны фильтры, нужны галочки: какие каталоги выгружать, какие не надо, и это должно выгружаться из клиента - этим нужно пользователям (например, бухгалтера - для обмена данными). Ну и для бекапа, в частности. При выгрузке кфг такие данные выгружать в общем случае, не нужно. Даже если, например, и нужно перенести пользовательские данные вместе с кфг на другой сервер, то можно выгрузить кфг и данные отдельно друг от друга - это уже частный случай.\r\n\r\nДля реализации массовой выгрузки/загрузки по 2 сценарию фильтры, галочки и прочее не нужны, т.к. это системные данные, и они нужны ВСЕ по определению (иначе система будет работать неправильно). Перечисления, как вариант, должны быть встроены в кфг (или хранящиеся в БД/файле рядом с кфг) - пары ключ-значение (может с доп.атрибутами). Их уже нужно выгружать/загружать вместе с кфг. Если Перечисления хранить в каталогах, то нужно помечать такие каталоги, как системные, и тоже выгружать/загружать их вместе с кфг.\r\n\r\n\r\n\r\n\r\nУ конфигурации есть два режиме ДЕБАГ и РЕЛИЗ.\r\n\r\nКонфигурация создаётся в режиме ДЕБАГ по умолчанию.\r\n\r\nПри выгрузке мы в дизайнере указываем в каком режиме выгружать конфигурацию - релиз или дебаг - и в зависимости от выбранного режима \r\n\r\nсоздаётся некий зашифрованный файлик в котором содержится ClientLicenseTypeId и в каком режиме выгрузили кфг.\r\n\r\nПри импорте сервер также прописывает кфг в файлике и её режим (дебаг или релиз). Также там возможно будет хранится путь до сервера \r\n\r\nобновления (у каждой кфг он может быть свой)\r\n\r\nПри выгрузке в режиме РЕЛИЗ у всех объектов кфг проставляется флаг default=true\r\n\r\n\r\n**Обновления**\r\n\r\n3 Варианта:\r\n\r\n1. Разрешаем менять вообще всё, но после первого изменения слетает поддержка (Больше нельзя будет накатывать обновления)\r\n\r\n2. Разрешаем менять вообще всё и после обновления мёрджим все наши изменения с изменениями пользователя\r\n\r\n3. Запрещаем менять все наши объекты (те, которые помечены флагом default=true), но разрешаем добавлять/изменять/удалять новые и ТОЛЬКО\r\n\r\nВ этом варианте при обновлении мы накатываем наши изменения на наши же объекты (почеменные флагом default=true), тут мёрджить ничего не нужно, так как пользователь не мог вносить в них изменения. \r\n\r\nЗатем мы проверяем все ПОЛЬЗОВАТЕЛЬСКИЕ представления (view), формы и скрипты.\r\n\r\n**Проверка представления(View)**\r\nМы проверяем, существуют ли ещё используемые в представлении каталоги и поля\r\nЕсли после проверки оказывается, что каких то каталогов или полей уже не существует, то сообщаем в каком вью у пользователя проблемы\r\n\r\n**Проверка форм**\r\nМы проверяем, существуют ли ещё используемые контролами(модель, чекер и др.) формы каталоги и поля\r\nЕсли после проверки оказывается, что каких то каталогов или полей уже не существует, то сообщаем на какой форме у пользователя проблемы\r\n\r\n**Проверка скрипта**\r\nС помощью какого-то написанного нами анализатора проверяем весь скрипт пользователя на предмет:\r\n- Используется ли в нём обращение к каталогам и полям, которых уже не существует\r\n- Используется ли в нём обращание к методам нашего скрипта, которые были удалены или переименованы\r\nЕсли анализатор находит что-то из этого, то мы сообщаем в каком файле и где у пользователя не соответствие с новой структурой конфигурации','Механизм обновления и защиты конфигураций Omega'),(93,35,'','',NULL,NULL,'2013-11-18 11:33:13','2013-11-18 11:33:13',92,1,0,8,'**Изменения, обновления и версионность КФГ**\r\n\r\n1. Номер версии состоит из 4 цифр - “A.B.C.D”\r\n2. При создании кфг ей назначается текущая версия “0.1.0.0” (по умолчанию, в момент создания можно переопределить). Того, кто ее создал (автор), назовем Поставщик.\r\n3. При создании кфг на сервере (предположительно, в БД) создается журнал изменений кфг \r\n4. Каждое изменение кфг через дизайнер (любым пользователем) записывается в журнал изменений. Туда заносится дата/время изменения, тип изменения (add/edit/delete), измененный мета-объект и юзер, выполнивший изменение.\r\n5. После внесения всех запланированных изменений в кфг, текущая версия “релизится”\r\n6. Процесс “релиза” заключается в следующем:\r\n\r\n6.1. Формирование и выгрузка инкрементального обновления кфг\r\n\r\n    6.1.1 Весь журнал изменений, начиная либо с начала (если не было ни одного “релиза”), либо с последнего релиза, объединяется, группируется по определенному алгоритму и в результате получается так называемый diff - дельта изменений, между датой предыдущего “релиза” и текущим моментом.\r\n\r\n    6.1.2 Diff является файлом с определенной структурой, содержащий инструкции по добавлению/изменению/удалению мета-объектов кфг вместе с самими мета-объектами.\r\n\r\n    6.1.3 В журнале момент “релиза” отмечается особым образом для того, чтоб следующий diff собрать начиная с этого момента.\r\n\r\n    6.1.4 Из diff-а формируется пакет обновления, которому автоматически назначается текущая версия (при этом релизер может ее  переопределить) и предыдущая, на которую и только на которую может встать данное обновление (это делается в целях обеспечения применения инкрементальных обновлений по цепочке - одно за другим). \r\n\r\n    6.1.5 Пакет инкрементального обновления выгружается в файл\r\n\r\n6.2. Формирование и выгрузка полного обновления\r\n\r\n    6.2.1 Выгружаемой кфг-ии назначается текущая версия, при этом релизер может ее переопределить.\r\n\r\n    6.2.2 Кфг выгружается в файл\r\n\r\n7. Кфг имеет два режима - “Просмотр” и “Редактирование”. После создания кфг имеет режим по умолчанию “Редактирование”. После импорта (установки) кфг имеет режим по умолчанию “Просмотр”. Переход из режима “Просмотр” в режим “Редактирование” определяется системой защиты кфг и примененной политикой доступа к кфг. О системе защиты см. раздел “Защита кфг”. В режиме “Просмотр” в дизайнере не доступны никакие объекты кфг, имеется возможность только редактировать настройки сервера, пользователей, лицензии. В режиме “Редактирование” кфг доступна для изменения.\r\n8. Изменение кфг и выпуск обновлений доступны только в режиме “Редактирование”\r\n9. Кфг имеет признак “На поддержке”. После импорта (установки) кфг признак выставляется в true. До тех пор, пока кфг на поддержке (признак = true) - к кфг можно применять инкрементальные обновления. Кфг снимается с поддержки при внесении в нее любых изменений (в случае, если политика доступа к кфг это позволяет). В этом случае, при переходе в режим “Редактирование” признак будет сброшен в false, в результате чего инкрементальные обновления применять больше будет нельзя. После создания кфг признак выставляется в false, таким образом, у разработчика кфг (у того, кто ее создал) не будет возможности применять инкрементальные обновления, но это ему не нужно по определению, т.к. он сам выпускает эти обновления.\r\n10. В механизм применения обновлений нужно встроить возможность переноса данных между каталогами/полями. Инкрементальные обновления при этом должны содержать соответствующие инструкции по переносу данных.\r\n11. Необходимо установление соответствия между мета-объектами старой и новой кфг - как вариант, введение GUID для ключевых (или для всех) узлов кфг (мета-объектов системы)\r\n\r\n**Защита кфг**\r\n\r\nЦели и задачи, преследуемые системой по защите кфг:\r\n\r\n1. Система должна контролировать подлинность кфг, то есть быть уверенной в том, что кфг поставляется от того, от кого ожидается\r\n\r\n2. Система должна обеспечивать целостность кфг, то есть исключить в ней  несанкционированные изменения\r\n\r\n3. Реализовать политику доступа к кфг, определяющую возможность просмотра/редактирования мета-объектов, скриптов\r\n\r\n3.1. Просмотр - модификаторы доступа к мета-объектов (public/private). Public объекты можно просматривать, private - скрыты.\r\n\r\n3.2. Редактирование - разрешить изменять кфг только Поставщику (по умолчанию) и тем, кому автор даст явное разрешение.\r\n\r\n\r\nеще?...\r\n\r\nМероприятия по достижению поставленных целей и задач:\r\n\r\n1. Необходимо создать web-сервис, содержащий реестр соответствий зарегистрированных кфг и выданных им сертификатов. Должен иметь возможность выдавать публичный сертификат для запрошенной конфигурации (по SSL).\r\n\r\n2. При создании кфг генерируется пара публичный-приватный ключ с сертификатом публичного ключа. Сертификат должен быть заверен корневым CA. Публичный ключ регистрируется на web-сервисе.\r\n\r\n3. При каждом “релизе” инкрементальное и полное обновление подписываются приватным ключом, подпись сохраняется в обновлении\r\n\r\n4.  При установке обновления (инкр. или полного) Omega-сервер делает запрос к web-сервису для получения сертификата публичного ключа, соответствующего обновляемой кфг. Из сертификата извлекается публичный ключ, с помощью которого выполняется проверка подписи обновления. Таким образом обеспечивается контроль подлинности обновлений.\r\n\r\n\r\n**Работа с данными (массовая выгрузка/загрузка)**\r\n\r\nРабота с данными в контексте выгрузки/загрузки подразумевает два сценария:\r\n\r\n1. Работа с пользовательскими данными\r\nПользовательские данные - это данные предметной области, реализованной в кфг. Это данные, необходимые пользователям кфг (пример: Заказы, Клиенты, Лицензии и т.д.)\r\n\r\n1. Работа с системными данными\r\nСистемные данные - это данные, необходимые для корректной работы кфг. Это могут быть перечисления (пример: Страны, Языки), классификаторы (пример: КЛАДР, МКБ).\r\n\r\n\r\nДля реализации массовой выгрузки/загрузки по 1 сценарию нужны фильтры, нужны галочки: какие каталоги выгружать, какие не надо, и это должно выгружаться из клиента - этим нужно пользователям (например, бухгалтера - для обмена данными). Ну и для бекапа, в частности. При выгрузке кфг такие данные выгружать в общем случае, не нужно. Даже если, например, и нужно перенести пользовательские данные вместе с кфг на другой сервер, то можно выгрузить кфг и данные отдельно друг от друга - это уже частный случай.\r\n\r\nДля реализации массовой выгрузки/загрузки по 2 сценарию фильтры, галочки и прочее не нужны, т.к. это системные данные, и они нужны ВСЕ по определению (иначе система будет работать неправильно). Перечисления, как вариант, должны быть встроены в кфг (или хранящиеся в БД/файле рядом с кфг) - пары ключ-значение (может с доп.атрибутами). Их уже нужно выгружать/загружать вместе с кфг. Если Перечисления хранить в каталогах, то нужно помечать такие каталоги, как системные, и тоже выгружать/загружать их вместе с кфг.\r\n\r\n\r\n\r\n\r\nУ конфигурации есть два режиме ДЕБАГ и РЕЛИЗ.\r\n\r\nКонфигурация создаётся в режиме ДЕБАГ по умолчанию.\r\n\r\nПри выгрузке мы в дизайнере указываем в каком режиме выгружать конфигурацию - релиз или дебаг - и в зависимости от выбранного режима \r\n\r\nсоздаётся некий зашифрованный файлик в котором содержится ClientLicenseTypeId и в каком режиме выгрузили кфг.\r\n\r\nПри импорте сервер также прописывает кфг в файлике и её режим (дебаг или релиз). Также там возможно будет хранится путь до сервера \r\n\r\nобновления (у каждой кфг он может быть свой)\r\n\r\nПри выгрузке в режиме РЕЛИЗ у всех объектов кфг проставляется флаг default=true\r\n\r\n\r\n**Обновления**\r\n\r\n3 Варианта:\r\n\r\n1. Разрешаем менять вообще всё, но после первого изменения слетает поддержка (Больше нельзя будет накатывать обновления)\r\n\r\n2. Разрешаем менять вообще всё и после обновления мёрджим все наши изменения с изменениями пользователя\r\n\r\n3. Запрещаем менять все наши объекты (те, которые помечены флагом default=true), но разрешаем добавлять/изменять/удалять новые и ТОЛЬКО\r\n\r\nВ этом варианте при обновлении мы накатываем наши изменения на наши же объекты (почеменные флагом default=true), тут мёрджить ничего не нужно, так как пользователь не мог вносить в них изменения. \r\n\r\nЗатем мы проверяем все ПОЛЬЗОВАТЕЛЬСКИЕ представления (view), формы и скрипты.\r\n\r\n**Проверка представления(View)**\r\nМы проверяем, существуют ли ещё используемые в представлении каталоги и поля\r\nЕсли после проверки оказывается, что каких то каталогов или полей уже не существует, то сообщаем в каком вью у пользователя проблемы\r\n\r\n**Проверка форм**\r\nМы проверяем, существуют ли ещё используемые контролами(модель, чекер и др.) формы каталоги и поля\r\nЕсли после проверки оказывается, что каких то каталогов или полей уже не существует, то сообщаем на какой форме у пользователя проблемы\r\n\r\n**Проверка скрипта**\r\nС помощью какого-то написанного нами анализатора проверяем весь скрипт пользователя на предмет:\r\n- Используется ли в нём обращение к каталогам и полям, которых уже не существует\r\n- Используется ли в нём обращание к методам нашего скрипта, которые были удалены или переименованы\r\nЕсли анализатор находит что-то из этого, то мы сообщаем в каком файле и где у пользователя не соответствие с новой структурой конфигурации','Механизм обновления и защиты конфигураций Omega'),(94,1,'','',NULL,NULL,'2013-12-02 09:23:13','2013-12-02 09:23:13',NULL,0,0,10,'1. ТРЕБОВАНИЯ\r\n\r\nНазвание файлов с информационными материалами должны сформироваться следующим образом:\r\n\r\n1.	Предмет информационного материала. Например, название продукта: \"Живой редактор\",  \"Локализация\" и т.д., без кавычек\r\n+\r\n2.	Тип материала (например: новость, пресс-релиз, статья, текст для сайта, руководство пользователя и т.д.)\r\n+\r\n3.	Дата публикации (когда требуется; например, для новости) в формате ГГГГ-ММ-ДД\r\n+\r\n4.	Место публикации материала и/или номер материала с дефисом (если номер требуется для сортировки; например \"Компьютерра - \", \"1-\" или \"2-\")\r\n+\r\n5.	Название материала (когда требуется; например, заголовок статьи)\r\n+\r\n6.	Код языка (большими буквами \"RU\" - русский, \"EN\" - английский)\r\n+\r\n7.	Номер версии (например, v1)\r\n+\r\n8.	Назначение файла (не требуется, если файл содержит исходник): \"print\" – для печати, \"web\" – для сайта\r\n\r\n9.	Пункты разделяются нижним подчеркиванием. 2 и более подчеркиваний не допускается\r\n\r\n10.	Использование заглавных букв допускается только в предмете (1) и фирменных обозначениях в названии материала (5)\r\n\r\n11.	Вместо длинных фирменных обозначений рекомендуется использовать сокращения (например, \"1С-БУС\" вместо \"1С-Битрикс: Управление сайтом\")\r\n\r\n\r\nПРИМЕРЫ\r\n\r\n•	Живой редактор_статья_способы редактирования контента в 1С-БУС_RU_v11.docx\r\n\r\n•	Живой редактор_пресс-релиз_2013-09-01_выход модуля и акция_RU_v1.docx\r\n\r\n•	Локализация_текст для сайта_1-редактирование интерфейса_RU_v13.docx\r\n\r\n•	Локализация_руководство пользователя_RU_v6_web.pdf\r\n','Регламент по наименоваю файлов с информационными материалами'),(95,2,'','',NULL,NULL,'2013-12-02 09:25:04','2013-12-02 09:25:04',94,0,0,10,'Данный регламент содержит основные правила наименования файлов в информационными материалами. Последняя версия регламента находится во Вложениях','Регламент по наименоваю файлов с информационными материалами'),(96,1,'','',NULL,NULL,'2013-12-02 09:30:31','2013-12-02 09:30:31',NULL,0,0,11,'В данном регламенте описываются основные требования к текстам: копирайтинг и рерайтинг\r\n\r\nВ регламенте также рассматриваются основные ошибки, с которыми сталкивались при работе над текстами, и приводятся примеры, как делать правильно\r\n\r\nПоследняя версия документа находится во Вложениях','Регламент по копирайтингу и рерайтингу'),(97,23,'','',NULL,NULL,'2013-12-10 10:20:00','2013-12-10 10:20:00',31,0,0,4,'HTML/CSS\r\n--------\r\n\r\n1. Нет селектора кроме класса (исключение составляют семантически обязательные наследники: table.class1 td, ul.class2 li, select.class3 option)\r\n2. Если необходимо в рамках существующей верстки добавить класс для взаимодействия с JavaScript, его наименование должно быть согласно шаблону **js-действиеОбъект**\r\n3. По возможности, не использовать **!important**\r\n4. Отделение логических блоков производится по типу наследования в названии класса. \r\n\r\n    **Пример:** \r\n \r\n        div.userInfo\r\n    	    span.userInfo-name\r\n    	    div.userInfo-rating\r\n    		a.userInfo-rating-vote\r\n\r\n5. Если в новый логический блок вставляется уже существующий, он описывается дополнительным классом наследования. \r\n\r\n    **Пример:**\r\n \r\n        div.userPage\r\n            div.userPage-title\r\n            div.userPage-info.userInfo\r\n                span.userInfo-name\r\n                …\r\n \r\nJavaScript\r\n----------\r\n1. Наименования переменных назначаются по шаблону типОбъект(Действие/Свойство)\r\n    **Примеры:**\r\n\r\n    **Boolean**	bLogoutFlag\r\n\r\n    **Integer**	iStepCounter\r\n\r\n    **String**	sUserName\r\n\r\n    **Function**	buttonClick\r\n\r\n    **jQueryObject**	$buttonLogout\r\n\r\n    **Object**	oQueryData\r\n\r\n    **Array(List)**	aUsers\r\n\r\n2. Шаблоны и селекторы – только в конфигурационных переменных\r\n\r\n    **Примеры:**\r\n\r\n        var sUserInfoTpl = ‘<div class=”userInfo”>#NAME# #LAST_NAME#</div>’,\r\n\r\n        sUserPageSelector = ‘div.userPage’;\r\n    \r\n        sUserInfoTpl.replace(‘#NAME#’,oUser[‘NAME’]);\r\n\r\n        sUserInfoTpl.replace(‘#LAST_NAME#’,sUser[‘LAST_NAME’]);\r\n    \r\n        $( sUserPageSelector).html(sUserInfoTpl);\r\n\r\n3. Все ключи конфигурационных объектов пишутся заглавными буквами:\r\n\r\n        oUserQueryConfig = {\r\n        	‘NAME_TPL’: ’<div class=”userInfo-name”></div>’,\r\n        	‘SESSION_ID’: sessid,\r\n        	‘QUERY_URL’: ’/get_user_info’\r\n        }\r\n','Регламент фронт-енд разработки'),(99,1,'','',NULL,NULL,'2014-06-06 11:50:23','2014-06-06 11:50:23',NULL,0,0,12,'require_once($_SERVER[\"DOCUMENT_ROOT\"].\"/bitrix/modules/main/include/prolog_before.php\");\r\nCModule::includeModule(\"highloadblock\");\r\nuse Bitrix\\Highloadblock as HL;\r\n\r\n$data = array(\r\n		\'NAME\' => \"MyHlIblock\",\r\n		\'TABLE_NAME\' => \"my_hl_block_name\"\r\n	);\r\n$result = HL\\HighloadBlockTable::add($data);\r\n$ID = $result->getId();\r\n\r\n$arFields = Array(\r\n	\"ENTITY_ID\" => \"HLBLOCK_\".$ID,\r\n	\"FIELD_NAME\" => \"UF_TITLE\",\r\n	\"USER_TYPE_ID\" => \"string\",\r\n	\"EDIT_FORM_LABEL\" => Array(\"ru\"=>\"заголовок\", \"en\"=>\"title\")\r\n);\r\n$obUserField  = new CUserTypeEntity;\r\n$obUserField->Add($arFields);','HighLoad Инфоблоки. Создание инфоблока и добавление поля.'),(100,2,'','',NULL,NULL,'2014-06-06 11:50:49','2014-06-06 11:50:49',99,0,0,12,'require_once($_SERVER[\"DOCUMENT_ROOT\"].\"/bitrix/modules/main/include/prolog_before.php\");\r\n\r\nCModule::includeModule(\"highloadblock\");\r\n\r\nuse Bitrix\\Highloadblock as HL;\r\n\r\n$data = array(\r\n		\'NAME\' => \"MyHlIblock\",\r\n		\'TABLE_NAME\' => \"my_hl_block_name\"\r\n	);\r\n\r\n$result = HL\\HighloadBlockTable::add($data);\r\n\r\n$ID = $result->getId();\r\n\r\n$arFields = Array(\r\n	\"ENTITY_ID\" => \"HLBLOCK_\".$ID,\r\n	\"FIELD_NAME\" => \"UF_TITLE\",\r\n	\"USER_TYPE_ID\" => \"string\",\r\n	\"EDIT_FORM_LABEL\" => Array(\"ru\"=>\"заголовок\", \"en\"=>\"title\")\r\n);\r\n\r\n$obUserField  = new CUserTypeEntity;\r\n\r\n$obUserField->Add($arFields);','HighLoad Инфоблоки. Создание инфоблока и добавление поля.'),(101,1,'','',NULL,1,'2014-07-18 11:41:22','2014-07-18 11:41:22',NULL,0,0,13,'Замечательный IDE от наших соотечественников, которым рекомендуем пользоваться всем!','PHP Storm'),(102,1,'','',NULL,1,'2014-07-18 11:47:34','2014-07-18 11:47:34',NULL,0,0,14,'Настройки сравнения контента\r\n============================\r\nВ проектах, не использующих систему контроля версий, часто приходится сталкиваться с проблемой затирания изменений, внесенных на сервере с другими людьми. Для того, чтобы этого не происходило, рекомендуется настроить PHPStorm на уведомления о различиях между файлом на сервере и рабочей локальной версией.\r\n\r\nДля этого откройте пункт меню **Tools->Deployment->Options**\r\n\r\nВ открывшемся окне проставьте пункт **Warn when uploading over newer file** в значение **Compare content** \r\nКроме этого, установите галочку **Notify about remote changes**\r\n\r\nПосле этого, если у вас настроен FTP или SFTP сервер по-умолчанию, IDE будет уведомлять вас об изменениях на сервере при открытии локальных файлов.','Настройки деплоймента'),(103,2,'','',NULL,1,'2014-07-22 14:36:17','2014-07-22 14:36:17',102,0,0,14,'Настройки сравнения контента\r\n============================\r\nВ проектах, не использующих систему контроля версий, часто приходится сталкиваться с проблемой затирания изменений, внесенных на сервере с другими людьми. Для того, чтобы этого не происходило, рекомендуется настроить PHPStorm на уведомления о различиях между файлом на сервере и рабочей локальной версией.\r\n\r\nДля этого откройте пункт меню **Tools->Deployment->Options**\r\n\r\nВ открывшемся окне проставьте пункт **Warn when uploading over newer file** в значение **Compare content** \r\nКроме этого, установите галочку **Notify about remote changes**\r\n\r\nПосле этого, если у вас настроен FTP или SFTP сервер по-умолчанию, IDE будет уведомлять вас об изменениях на сервере при открытии локальных файлов.\r\n\r\n\r\nКроме того, будет полезным назначить горячую клавишу на скачку с сервера по-умолчанию.\r\n\r\nДля этого необходимо открыть настройки IDE, выбрать графу Keymap и найти там запись **Main Manu** -> **Tools** -> **Deployment** -> **Download from Default Server**\r\n\r\nКликнув на нё дважды, нажите Add Keyboard Shortcut после чего нажмите удобное незанятое сочетание клавиш (у меня это **Alt+Shift+D**). Теперь, выбрав файл или папку, её очень удобно можно актуализировать, нажав выбранные горячие клавиши.','Настройки деплоймента'),(104,3,'','',NULL,1,'2014-07-22 14:36:45','2014-07-22 14:36:45',103,0,0,14,'Настройки сравнения контента\r\n============================\r\nВ проектах, не использующих систему контроля версий, часто приходится сталкиваться с проблемой затирания изменений, внесенных на сервере с другими людьми. Для того, чтобы этого не происходило, рекомендуется настроить PHPStorm на уведомления о различиях между файлом на сервере и рабочей локальной версией.\r\n\r\nДля этого откройте пункт меню **Tools->Deployment->Options**\r\n\r\nВ открывшемся окне проставьте пункт **Warn when uploading over newer file** в значение **Compare content** \r\nКроме этого, установите галочку **Notify about remote changes**\r\n\r\nПосле этого, если у вас настроен FTP или SFTP сервер по-умолчанию, IDE будет уведомлять вас об изменениях на сервере при открытии локальных файлов.\r\n----------------------------\r\n\r\nКроме того, будет полезным назначить горячую клавишу на скачку с сервера по-умолчанию.\r\n\r\nДля этого необходимо открыть настройки IDE, выбрать графу Keymap и найти там запись **Main Manu** -> **Tools** -> **Deployment** -> **Download from Default Server**\r\n\r\nКликнув на нё дважды, нажите **Add Keyboard Shortcut** после чего нажмите удобное незанятое сочетание клавиш (у меня это **Alt+Shift+D**). Теперь, выбрав файл или папку, её очень удобно можно актуализировать, нажав выбранные горячие клавиши.','Настройки деплоймента'),(105,4,'','',NULL,1,'2014-07-22 14:38:36','2014-07-22 14:38:36',104,0,0,14,'Настройки сравнения контента\r\n============================\r\nВ проектах, не использующих систему контроля версий, часто приходится сталкиваться с проблемой затирания изменений, внесенных на сервере с другими людьми. Для того, чтобы этого не происходило, рекомендуется настроить PHPStorm на уведомления о различиях между файлом на сервере и рабочей локальной версией.\r\n\r\nДля этого откройте пункт меню **Tools->Deployment->Options**\r\n\r\nВ открывшемся окне проставьте пункт **Warn when uploading over newer file** в значение **Compare content** \r\nКроме этого, установите галочку **Notify about remote changes**\r\n\r\nПосле этого, если у вас настроен FTP или SFTP сервер по-умолчанию, IDE будет уведомлять вас об изменениях на сервере при открытии локальных файлов.\r\n\r\n\r\nКроме того, будет полезным назначить горячую клавишу на скачку с сервера по-умолчанию.\r\n\r\nДля этого необходимо открыть настройки IDE, выбрать графу Keymap и найти там запись **Main Manu** -> **Tools** -> **Deployment** -> **Download from Default Server**\r\n\r\nКликнув на нё дважды, нажите **Add Keyboard Shortcut** после чего нажмите удобное незанятое сочетание клавиш (у меня это **Alt+Shift+D**). Теперь, выбрав файл или папку, её очень удобно можно актуализировать, нажав выбранные горячие клавиши.','Настройки деплоймента'),(106,5,'','',NULL,1,'2014-07-22 14:40:13','2014-07-22 14:40:13',105,0,0,14,'Настройки сравнения контента\r\n============================\r\nВ проектах, не использующих систему контроля версий, часто приходится сталкиваться с проблемой затирания изменений, внесенных на сервере с другими людьми. Для того, чтобы этого не происходило, рекомендуется настроить PHPStorm на уведомления о различиях между файлом на сервере и рабочей локальной версией.\r\n\r\nДля этого откройте пункт меню **Tools->Deployment->Options**\r\n\r\nВ открывшемся окне проставьте пункт **Warn when uploading over newer file** в значение **Compare content** \r\nКроме этого, установите галочку **Notify about remote changes**\r\n[image:3]\r\nПосле этого, если у вас настроен FTP или SFTP сервер по-умолчанию, IDE будет уведомлять вас об изменениях на сервере при открытии локальных файлов.\r\n\r\n\r\nКроме того, будет полезным назначить горячую клавишу на скачку с сервера по-умолчанию.\r\n\r\nДля этого необходимо открыть настройки IDE, выбрать графу Keymap и найти там запись **Main Manu** -> **Tools** -> **Deployment** -> **Download from Default Server**\r\n[image:4]\r\nКликнув на нё дважды, нажите **Add Keyboard Shortcut** после чего нажмите удобное незанятое сочетание клавиш (у меня это **Alt+Shift+D**). Теперь, выбрав файл или папку, её очень удобно можно актуализировать, нажав выбранные горячие клавиши.','Настройки деплоймента'),(107,1,'','',NULL,1,'2014-08-25 08:22:30','2014-08-25 08:22:30',NULL,0,0,15,'В этой группе статей описаны стандарты, которые помогут эффективно использовать ваш трекер в своей работе.','Трекер Chip-Time'),(108,1,'','',NULL,1,'2014-08-25 08:32:45','2014-08-25 08:32:45',NULL,0,0,16,'От того, насколько правильно и четко сформулирована задача напрямую зависит время её выполнения.\r\n\r\nПостарайтесь следовать этим простым принципам при постановке задачи, и вы существенно сэкономите свое и чужое время на разъяснения.\r\n\r\n1. Задача должна быть конкретной и четко сформулированной\r\nПри поручении задания необходимо четко обозначить проблему, указав при этом на возможные источники информации, рассказав о значимости, срочности, приведя примеры решения. Другими словами, постараться дать в вопросе 75% ответа. В таком случае, скорее всего, задача будет воспринята подчиненным правильно и выполнена с результатом, близким к желаемому. Если вы видите большое количество найденных системой похожих задач, когда вводите текущую, это значит, что задача сформулирована неполно и требует дополнительных комментариев.\r\n2. Задача должна содержать в себе достаточно информации для того, чтобы не знакомый с проектом человек мог сразу начать её делать\r\n3. Не дублируйте задачи\r\nЕсли задача, которую вы ставите, имеет похожие, то трекер сообщит вам об этом, отобразив количество похожих задач под полем ввода новой. Если эту задачу уже делали, информация о проделанной работе поможет исполнителю быстрее вспомнить, о чем идет речь. Если же задача новая, можно дать в ней ссылки на похожие задачи, чтобы они были выполнены в едином ключе.\r\n4. Используйте короткие теги выполнения\r\nТакие слова, как \"для\", \"до\" и другие короткие теги в тексте задачи несут в себе дополнительные возможности по быстрому выбору ответственного, обозначению сроков выполнения задачи, установке примерного времени и т.д. Последовательностью \"///\" при создании задачи можно отделить её заголовок от её описания. \r\n5. Задача должна быть измеримой по временным срокам и выполнимой\r\nВ противном случае, будет сложно определить, достигнут ли результат','Постановка задачи'),(109,2,'','',NULL,1,'2014-08-25 08:33:15','2014-08-25 08:33:15',108,0,0,16,'От того, насколько правильно и четко сформулирована задача напрямую зависит время её выполнения.\r\n\r\nПостарайтесь следовать этим простым принципам при постановке задачи, и вы существенно сэкономите свое и чужое время на разъяснения.\r\n\r\n1. **Задача должна быть конкретной и четко сформулированной**\r\nПри поручении задания необходимо четко обозначить проблему, указав при этом на возможные источники информации, рассказав о значимости, срочности, приведя примеры решения. Другими словами, постараться дать в вопросе 75% ответа. В таком случае, скорее всего, задача будет воспринята подчиненным правильно и выполнена с результатом, близким к желаемому. Если вы видите большое количество найденных системой похожих задач, когда вводите текущую, это значит, что задача сформулирована неполно и требует дополнительных комментариев.\r\n2. **Задача должна содержать в себе достаточно информации для того, чтобы не знакомый с проектом человек мог сразу начать её делать**\r\n3. **Не дублируйте задачи**\r\nЕсли задача, которую вы ставите, имеет похожие, то трекер сообщит вам об этом, отобразив количество похожих задач под полем ввода новой. Если эту задачу уже делали, информация о проделанной работе поможет исполнителю быстрее вспомнить, о чем идет речь. Если же задача новая, можно дать в ней ссылки на похожие задачи, чтобы они были выполнены в едином ключе.\r\n4. **Используйте короткие теги выполнения**\r\nТакие слова, как \"для\", \"до\" и другие короткие теги в тексте задачи несут в себе дополнительные возможности по быстрому выбору ответственного, обозначению сроков выполнения задачи, установке примерного времени и т.д. Последовательностью \"///\" при создании задачи можно отделить её заголовок от её описания. \r\n5. **Задача должна быть измеримой по временным срокам и выполнимой**\r\nВ противном случае, будет сложно определить, достигнут ли результат','Постановка задачи'),(110,3,'','',NULL,1,'2014-08-25 08:38:44','2014-08-25 08:38:44',109,0,0,16,'От того, насколько правильно и четко сформулирована задача напрямую зависит время её выполнения.\r\n\r\nПостарайтесь следовать этим простым принципам при постановке задачи, и вы существенно сэкономите свое и чужое время на разъяснения.\r\n\r\n1. **Задача должна быть конкретной и четко сформулированной**\r\nПри поручении задания необходимо четко обозначить проблему, указав при этом на возможные источники информации, рассказав о значимости, срочности, приведя примеры решения. Другими словами, постараться дать в вопросе 75% ответа. В таком случае, скорее всего, задача будет воспринята исполнителем правильно и выполнена с результатом, близким к желаемому. Если вы видите большое количество найденных системой похожих задач, когда вводите текущую, это значит, что задача сформулирована неполно и требует дополнительных комментариев.\r\n2. **Задача должна содержать в себе достаточно информации для того, чтобы не знакомый с проектом человек мог сразу начать е